(20, 'video', NULL, 28, 0, 'com_content', 'GCFmES804P4', 'jpg', 'original/05/70/9b/', 'Samsung Galaxy S III Review', 'For more details, check out our web site: http://www.phonearena.com/reviews/Samsung-Galaxy-S-III-Review_id3031\nWell, it is now 2012, and the time has finally come for the Galaxy S III to show up on stage. The difference between this launch and those of the Galaxy S\'s before it is that the expectations of the audience are much higher now. People were waiting to see the next BIG thing in the world of wireless. They weren\'t hoping for a top-notch specs sheet -- that was pretty much taken for granted. They were hoping for a ceramic body, a new, premium design that would not only get the job done, but would also spark a few envious ...', 1529, 0, '{\"image\":{\"format\":\"jpg\",\"width\":480,\"height\":360,\"url\":\"https:\\/\\/danhgia.net\\/media\\/reviews\\/videos\\/original\\/05\\/70\\/9b\\/GCFmES804P4.jpg\"},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":\"65\",\"height\":\"65\"},\"100x100c\":{\"format\":\"jpg\",\"width\":\"100\",\"height\":\"100\"},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":74},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 367, '', '', 1243, 0, '2012-11-25 04:02:00', '2022-12-04 05:31:31', 1, 1, 0, '', 1, 0, 0, 0, 0),
