(50, 'video', NULL, 34, 0, 'com_content', 'l4-YJSab4j4', 'jpg', 'original/d3/52/ed/', '2012 Audi R8 Drive & Review: Are these the best cars you can buy today?', '( http://www.TFLcar.com ) The 2012 Audi R8 5.2 FSI Quattro is supercar that you can drive to Dairy Queen for an ice cream cone in the morning and race it on track in the afternoon. But perhaps more importantly you\'ll love it no matter how you choose to drive it. In this TFLcar drive and Review we get to sample both the R8 Spyder and the V10 5.2 FSI Quattro. So is the Audi R8 one of the very best cars that you can buy today? Check out this review as the boys take an everyman approach to driving Audi\'s super car.', 530, 0, '{\"image\":{\"format\":\"jpg\",\"width\":480,\"height\":360},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":\"65\",\"height\":\"65\"},\"100x100c\":{\"format\":\"jpg\",\"width\":\"100\",\"height\":\"100\"},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":74},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 367, '', '', 1248, 0, '2012-11-27 18:25:00', NULL, 1, 1, 0, '', 1, 0, 0, 0, 0),
(51, 'video', NULL, 34, 0, 'com_content', '_TOFd7RMvqo', 'jpg', 'original/e8/28/96/', '2011 Audi R8 5.2 Video Review -- Kelley Blue Book', 'FOR MORE AUTOMOTIVE NEWS VISIT: \nhttp://www.kbb.com/audi/r8/2011-audi-r8/\n\nThe Audi R8 is a favorite among the staff at Kelley Blue Book. So when Audi added a second model to the R8 range featuring a more powerful 525-horsepower V10 our ears perked up. In this video KBB\'s Micah Muzio drives the Audi R8 5.2 FSI Quattro and explains why it isn\'t just a great car, it is his favorite car.', 371, 0, '{\"image\":{\"format\":\"jpg\",\"width\":480,\"height\":360},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":\"65\",\"height\":\"65\"},\"100x100c\":{\"format\":\"jpg\",\"width\":\"100\",\"height\":\"100\"},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":74},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 367, '', '', 1218, 0, '2012-11-27 18:25:00', NULL, 1, 1, 0, '', 1, 0, 0, 0, 0),
