(1003, 'video', NULL, 529, 0, 'com_content', '5F3z-uXg63I-v1372915858', 'jpg', 'original/54/85/a6/', '[M.G.P] Evil Dead (2013) - Trailer (Vietsub)', 'All rights Tristar Pictures.\nTrailer phụ đề Việt ngữ bởi hội MGP.\nFanpage: https://www.facebook.com/moviegossipparty.\n\n\nPhiên bản làm lại của tác phẩm kinh dị kinh điển sản xuất năm 1981 của đạo diễn Sam Raimi. Năm người bạn bị kẹt trong một căn nhà gỗ ở nơi hẻo lánh. Khi họ phát hiện ra quyển sách Naturon De Monto (Quyển Sách Tử Thần), họ đã vô ý đánh thức một hình thái ma quỷ vốn ngủ yên trong khu rừng kề bên. Họ lần lượt bị nó chiếm hữu thân xác cho đến khi chỉ còn một người đang ra sức chiến đấu vì sự sinh tồn.\n\nPhim ra mắt vào ngày 5 tháng 4, 2013. Với các diễn viên Jane Levy, Shiloh Fernandez, Jessica Lucas, Lou Taylor Pucci. Đạo diễn Fede Alvarez (tác phẩm đầu tay của đạo diễn người Uruguay).', 126, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\"},\"thumbnail\":{\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":74},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 968, '', '', 1580, 0, '2013-07-04 05:30:00', NULL, 1, 1, 0, '', 1, 0, 0, 0, 0),
