(1007, 'video', NULL, 531, 0, 'com_content', 'zCSpWXVngi4-v1372928638', 'jpg', 'original/de/00/50/', 'Đường Đua 2013 - Official Trailer [HQ]', 'Blue Productions hân hạnh giới thiệu trailer chính thức phim Đường đua (dự kiến ra mắt ngày 26/7/2013) với sự tham gia của Phạm Anh Khoa, Nhan Phúc Vinh, Quý Bình... Đường Đua được dàn dựng bởi đạo diễn Nguyễn Khắc Huy và chỉ đạo sản xuất Hồng Ánh. \n\nĐường Đua mô tả hành trình nghẹt thở của nhân vật chính Lộc, một cựu vận động viên điền kinh, nay trở thành tài xế xe tải, bị đẩy vào một cuộc chạy đua với tử thần để dành lại cơ hội sống cho cha và em gái... Anh không biết, cái chết đã đến bên ngưỡng cửa.\n\nPhim được phát hành bởi Hãng phim Thiên Ngân.\n\nTheo dõi các cập nhật mới nhất về Đường Đua tại: \nhttps://www.facebook.com/duongduamovie\nhttp://www.youtube.com/duongduamovie', 79, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\"},\"thumbnail\":{\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":74},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 968, '', '', 1205, 0, '2013-07-04 09:03:00', NULL, 1, 1, 0, '', 1, 0, 0, 0, 0),
