(1129, 'video', NULL, 595, 0, 'com_content', 'Gqgyaaa_ySk-v1374160418', 'jpg', 'original/e5/a5/72/', 'Rex Hotel in Saigon', 'Với vị trí thuận lợi, Khách sạn Rex là nơi dừng chân lý tưởng của nhiều du khách khi dừng chân tại Thành Phố Hồ Chí Minh đầy năng động. Khi bạn dừng chân tại Thành Phố nhộn nhịp này bạn sẽ không khỏi ngạc nhiên bởi vẻ đẹp lung linh huyền ảo của Khách sạn Rex nguy nga và lộng lẫy dưới những ánh đèn. Dường như Thành Phố Sài Gòn về đêm càng tô thêm vẻ đẹp của Khách sạn bởi nhiều hoạt động giải trí, vui chơi giúp du khách thuận tiện hơn khi nghỉ dưỡng tại đây. \n\nKhông những thế khi du khách nghỉ ngơi tại Khách Sạn Rex du khách có thể tham quan những di tích lịch sử như: toà nhà Ủy ban Nhân dân, nhà hát Thành phố đến chợ Bến Thành, dinh Thống Nhất, nhà thờ Đức Bà... Bạn hãy đến với Khách Sạn rex để có những kì nghỉ khám phá những công trình kiến trúc vĩ đại của nhân loại.\n\nKhách sạn Rex gồm 5 tầng với 230 phòng, trong đó có 53 phòng Suite và 14 phòng dạng căn hộ. Kiến trúc của khách sạn cuốn hút bởi sự cân đối, hài hòa giữa hiện đại và truyền thống. Nội thất của các phòng trong khách sạn được trang trí bằng mây tạo nên một nét rất riêng của khách sạn Rex. Tất cả các phòng đều được trang bị các thiết bị hiện đại, tiện nghi.\n\nVị trí\nNằm tọa lạc tại Trung Tâm Quận 1, Rex đã mang đến cảm giác thân thuộc như ngôi nhà thân quen của quý khách, Cách sân bay 8 km.', 621, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\"},\"thumbnail\":{\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":74},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 367, '', '', 1527, 0, '2013-07-18 15:13:00', '2013-07-18 15:13:00', 1, 1, 0, '', 1, 0, 0, 0, 0),
