(1225, 'video', NULL, 613, 0, 'com_content', 'K9WNBO3szgQ-v1376195613', 'jpg', 'original/38/93/09/', 'Get Smart Official Trailer #1 - (2008) HD', 'Agent Maxwell Smart (Steve Carell) and his more-savvy counterpart, Agent 99 (Anne Hathaway), try to stop the terrorist organization, KAOS.\n\nTM & © Warner Bros. Ent. (2012)\nCast: Alan Arkin, Steve Carell, Dwayne Johnson, David Koechner, Masi Oka, Terence Stamp, Anne Hathaway\nDirector: Peter Segal\nMOVIECLIPS YouTube Channel: http://j.mp/vqieFG\nJoin our Facebook page: http://j.mp/tb8OMH\nFollow us on Twitter: http://j.mp/rZzGsm\nBuy Movie: http://j.mp/sDSdnR\nProducer: Steve Carell, Alex Gartner, John Hockridge, Alan Glazer, Andrew Lazar, Charles Roven, Peter Segal\nScreenwriter: Tom J. Astle, Buck Henry, Matt Ember\nFilm Description: 40-Year-Old Virgin star Steve Carell steps into the telephonic shoes of television\'s most beloved bumbling detective in this big-screen adaptation of the hit 1960s-era comedy series created by Mel Brooks. The evil geniuses at KAOS have hatched a diabolical plot to dominate every living man, woman, and child on the planet, and their plot gets under way as they attack the headquarters of the U.S. spy agency Control. As a result of the attack, the identity of every agent working for Control has been compromised. Realizing that the only way to thwart KAOS\' evil plan is to promote eager but inexperienced Control analyst Maxwell Smart (Carell) to the rank of special agent, the Chief (Alan Arkin) reluctantly teams Smart with Agent 99 (Anne Hathaway) -- a veteran super-spy whose beauty is only surpassed by her lethality. With no real field experience to speak of and nothing but sheer enthusiasm and a handful of fancy spy gadgets to help him accomplish his deadly mission, Maxwell Smart his new partner, Agent 99, will be forced to faces malevolent KAOS head Siegfried (Terence Stamp) and his loyal army of minions in a decisive fight that will determine the fate of the free world. Dwayne \"The Rock\" Johnson, David Koechner, Terry Crews, and Ken Davitian co-star.', 178, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\",\"url\":\"https:\\/\\/danhgia.net\\/media\\/reviews\\/videos\\/original\\/38\\/93\\/09\\/K9WNBO3szgQ-v1376195613.jpg\"},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":\"65\",\"height\":\"65\"},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":75},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 1031, '', '', 1327, 0, '2013-08-11 04:33:00', '2023-04-14 18:14:15', 1, 1, 0, '', 1, 0, 0, 0, 0),
