(1468, 'video', NULL, 1566, 0, 'com_content', 'zH3O-CeZckE-v1378619908', 'jpg', 'original/69/54/2b/', 'Riddick Official Trailer #1 (2013) - Vin Diesel, Karl Urban Sci-Fi Movie HD', 'Subscribe to TRAILERS: http://bit.ly/sxaw6h\nSubscribe to COMING SOON: http://bit.ly/H2vZUn\nLike us on FACEBOOK:http://goo.gl/dHs73.\nRiddick Official Trailer #1 (2013) - Vin Diesel, Karl Urban Sci-Fi Movie HD \n\n\nLeft for dead on a sun-scorched planet, Riddick finds himself up against an alien race of predators. Activating an emergency beacon alerts two ships: one carrying a new breed of mercenary, the other captained by a man from Riddick\'s past.\n\nThe Movieclips Trailers channel is your destination for hot new trailers the second they drop. Whether they are blockbusters, indie films, or that new comedy you\'ve been waiting for, the Movieclips Trailers team is there day and night to make sure all the hottest new movie trailers are available whenever you need them, as soon as you can get them. All the summer blockbusters, Man of Steel, Oblivion, Pacific Rim, After Earth, The Lone Ranger, Star Trek Into Darkness and more! They are all available on Movieclips Trailers.\n\nIn addition to hot new trailers, the Movieclips Trailers page gives you original content like Ultimate Trailers, Instant Trailer Reviews, Monthly Mashups, and Meg\'s Movie News and more to keep you up-to-date on what\'s out this week and what you should be watching.\n\nmovieclips \"movie clips\" movieclipstrailers \"new trailers\" \"trailers HD\" hd trailers movieclipsDOTcom \"Vin Diesel\" \"Karl Urban\" \"Katee Sackhoff\" \"Dave Bautista\" \"chronicles of riddick\" David Twohy \"pitch black\" \"fast and the furious\" \"vin diesel movie\" \"riddick teaser\" \"riddick trailer\" eyes alien planet mercenary sun ship spaceship space predator etimmons sequel \"David Twohy\" 2013', 151, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\"},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":\"65\",\"heigh