(1788, 'video', NULL, 1701, 0, 'com_content', 'lEbZwLcv5U8-v1385546589', 'jpg', 'original/1b/a9/3a/', 'Panasonic Toughbook SX2', 'Website: http://www.toughbook.com\nBlog: http://www.panasonicforbusiness.com/category/rugged-computers-tablets/\nThe Toughbook SX2, introduced in October of 2012 is the next generation in Panasonic\'s business-rugged notebook PC line.  With advanced features such as 14.5 hours of battery life, an Intel® Core™ i5-3320M vPro™ processor (3MB cache, up to 3.3GHz) with Intel® Turbo Boost Technology and a lightweight, drop-resistant magnesium alloy design, the Toughbook SX2 is engineered to meet the standards of quality for which Toughbook mobile computers are known while providing maximum portability for highly valued executives and professionals.\n\nThe Toughbook SX2 is designed to withstand a highly mobile work environment, its magnesium alloy case and shock-mounted flex-connect hard drive allow it to handle up to a 30-inch drop to the base of the unit while operating, as well as a 12-inch drop from all other angles. Both the lid and base of the notebook are designed to withstand more than 220 lbs (100 kgf) of pressure, and the Toughbook SX2 also features LCD mounting protection. \n\nThe Toughbook SX2 allows workers to stay connected virtually all of the time with embedded wireless technologies including Wi-Fi and Bluetooth®.\n\nFor more details on the Toughbook SX2, go to http://www.Toughbook.com', 149, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\"},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":\"65\",\"height\":\"65\"},\"140x90c\":{\"format\":\"jpg\",\"width\":\"140\",\"height\":\"90\"},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":75},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 1623, '', '', 1282, 0, '2013-11-27 10:03:00', NULL, 1, 1, 0, '', 1, 0, 0, 0, 0),
