(2078, 'video', NULL, 1842, 0, 'com_content', 'hjwB7Y5nWXY-v1518451052', 'jpg', 'original/68/b1/6a/', 'CẦN CHUẨN BỊ GÌ CHO BUỔI TẬP ĐẦU TIÊN TẠI GETFIT GYM & YOGA?', 'VỚI NHỮNG BẠN CÒN PHÂN VÂN KHÔNG BIẾT NÊN CHUẨN BỊ GÌ KHI ĐẾN PHÒNG GYM LẦN ĐẦU TIÊN.\n➡️➡️➡️HÃY THEO DÕI CLIP SAU ĐỂ KHÁI QUÁT NHỮNG GÌ CẦN THIẾT CHO BUỔI TẬP ĐẦU TẠI GETFIT GYM & YOGA NHÉ. \n1. Chuẩn bị trang bị cần thiết như: \n-  Quần áo có chất liệu co giãn cho mục đích tập thể thao\n-  Giày\n- Khăn\n- Nước\n- Bao tay , đai quấn, thắt lưng,... ( tùy theo từng mục đích tập luyện)\n2. Bổ sung dinh dưỡng trước buổi tập ít nhất 60 phút.\n3. Khởi động kỹ trước khi tập\n4. Trong lúc tập phải tích cực tập luyện tăng dần cường độ. Luôn bổ sung nước sau mỗi hiệp tập.\n5. Thả lỏng cơ thể ngay sau tập để hỗ trợ quá trình phục hồi sau đó của cơ bắp.\n---\nGetfit Gym & Yoga với diện tích gần 2500 m2 tọa lạc tại trung tâm thành phố.\n➡️Với cơ sở vật chất cùng hệ thống máy tập cao cấp với từng khu vực riêng biệt đáp ứng đa dạng và chuyên sâu nhu cầu tập gym của từng hội viên. \n➡️Đội ngũ nhân viên tư vấn nhiệt tình, Huấn luyện viên được đào tạo chuyên nghiệp và các dịch vụ tiện ích đi kèm như:\n✔️Phòng xông hơi ướt/khô giúp giải tỏa căng thẳng sau những giờ làm việc mệt mỏi.\n✔️Khu Locker sang trọng.\n✔️Quầy Bar với nguồn thực phẩm dinh dưỡng dành riêng cho thể thao....\n➡️Luôn đáp ứng tối đa nhu cầu của Hội viên trước và sau khi tập. Getfit Gym & Yoga cam đoan chất lượng phục vụ cũng như sự hài lòng của khách hàng luôn là sự ưu tiên hàng đầu.\n', 102, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\"},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":65,\"height\":65},\"640x460s\":{\"format\":\"jpg\",\"width\":480,\"height\":360},\"150x120c\":{\"format\":\"jpg\",\"width\":150,\"height\":120},\"140x90c\":{\"format\":\"jpg\",\"width\":140,\"height\":90},\"208x118c\":{\"format\":\"jpg\",\"width\":208,\"height\":118},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":75},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 31314, '', '', 533, 20383171, '2018-02-12 15:57:32', '2018-02-12 15:58:00', 1, 1, 1, '', 1, 0, 0, 0, 0),
