(2156, 'video', NULL, 1861, 0, 'com_content', 'XAQT1_4XQD4-v1518567300', 'jpg', 'original/2d/60/1c/', 'cây cà gai leo chữa viêm gan b', 'http://www.thaoduocquy.net/ban-ca-gai-leo\nTheo các tài liệu nghiên cứu của Viện Dược liệu Trung ương và kết quả lâm sàng trên bệnh nhân viêm gan vi rút B thì có thể khẳng định đây là một cây thuốc có tác dụng rất tốt cho gan. Nó có khả năng làm giảm nồng độ vi rút trong máu của bệnh nhân, thậm chí đã ghi nhận trường hợp âm tính vi rút.và cũng đã được chứng minh có thể ngăn chặn xơ gan tiến triển và hạ men gan nhanh. Riêng việc điều trị các triệu chứng cơ năng của bệnh viêm gan B mạn tính hoạt động như vàng da, vàng mắt, đau tức hạ sườn phải, kém ăn mệt mỏi…thì Ca gai leo thể hiện tính ưu việt tuyệt đối so với các dược liệu được biết đến từ trước đến nay. Hầu hết các bệnh nhân đều hết các triệu chứng trên sau hai đến ba tháng điều trị. uống khoảng 6 tháng đến 1 năm thì sẻ hết men ga, và sau đó thì mình sẻ duy trì uống thường xuyên sẻ tốt hơn\n\nGần đây bệnh viện quân y  108 cũng đã thử chế phẩm có nguyên liệu từ Cà gai leo trên bệnh nhân viêm gan B mạn tính cho kết quả rất khả quan. Do vậy có thể khẳng định đây là một cây thuốc rất quý đối với việc hỗ trợ và điều trị một số các bệnh về gan.\n\ncà gai leo giả rượu thì không có thuốc giải rượu gì bằng, nếu ai thường xuyên uống rượu nhiều thì trước khi đi nhậu trắc khoảng 100g ca gai leo rồi uống 1 cốc trước khi nhậu, nhằm tăng tỉu lượng và giải rượu rất tốt, uống mải không thấy say, khi nhậu xong thì về nhà uống thêm một cốc nữa xong nằm ngủ một giấc là tỉnh rượu, không đau đầu, \n\nmột thí nghiệm cho thấy khi ngâm một ít cây này trong một chai rượu,  kết quả là thì chỉ sau một đêm sẽ phá huỷ một lượng lớn chất cồn trong đó\n\n\n\nCà gai leo Đức Thịnh\n\nThành phần hóa học chính như rễ có alcaloid, flavonoid. Dây có alcaloid.\n\nNhư vậy, qua những kết quả nghiên cứu trên đã đã chứng minh cho việc sử dụng cà gai leo để giải độc gan và chống viêm mạnh của người dân, điều này cũng cho thấy cây thuốc Nam của chúng ta có tác dụng mạnh và sẽ góp phần không nhỏ vào sự nghiệp chăm sóc và bảo vệ sức khỏe của người dân nếu được quan tâm đúng mức.\n\nĐông y cũng cho rằng ca gai leo có vị hơi the, tính ấm, có tác dụng tán phong thấp, đau lưng, nhức xương, tiêu độc, tiêu đờm, trừ ho, giảm đau, cầm máu, trị rắn cắn, viêm gan B, xơ gan, hạ men gan, gan nhiễm mỡ.\n\n   Hiện nay công ty chúng tôi đang bán giá: 120.000đ/1kg , \n\n   Rễ giá : 200.000đ/kg\n\n   viên ca gai leo tuệ linh 1 hộp 60 viên :132.000đ/hộp\n\n   viên giải độc gan tuệ linh 1 hộp 60 viên :192.000đ/hộp\n\n   Giống cà gai leo giá lẻ 10 ngàn 1 cây\n\n Hàng đảm bảo chất lượng hảy yên tâm khi mua hàng tại hệ thống thảo dược đức thịnh, khách hàng có thể đến địa chỉ của chúng tôi được tư vấn và phân biệt thật giả, mong quý khách có sức khỏe và hạnh phúc trong cuộc sống\n\n\n\n- Đặt hàng trực tiếp trên website: www.thaoduocquy.net hoạc trang web www.thaoduocducthinh.com', 253, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\",\"url\":\"https:\\/\\/danhgia.net\\/media\\/reviews\\/videos\\/original\\/2d\\/60\\/1c\\/XAQT1_4XQD4-v1518567300.jpg\"},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":65,\"height\":65},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":75},\"140x90c\":{\"format\":\"jpg\",\"width\":140,\"height\":90},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 31314, '', '', 567, 20383171, '2018-02-14 00:15:00', '2023-04-14 17:44:12', 1, 1, 0, '', 1, 0, 0, 0, 0),
