(2208, 'video', NULL, 1871, 0, 'com_content', 'scFbYGTwHPY-v1518667332', 'jpg', 'original/df/6f/0f/', 'Câu lạc bộ Thể dục thẩm mỹ Hoàng Gia - Nha Trang', 'Sau gần nhiều năm chuẩn bị, năm 2011, CLB thể thao Hoàng Gia quyết định đầu tư một “sân chơi” lớn hơn, nhằm đáp ứng nhu cầu làm đẹp ngày càng phong phú và đa dạng của chị em phụ nữ. Với diện tích gần 2000m2, tọa lạc trong một khuôn viên rộng rãi, thoáng mát, ngay trung tâm thành phố, CLB Hoàng Gia có đầy đủ các phòng tập gym, thẩm mỹ, Aerobic, yoga, cầu lông… chuyên dụng. Đây là tâm huyết của các thành viên trong CLB và là món quà tri ân dành cho những người đã, đang và sẽ gắn bó với Hoàng Gia.', 225, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\"},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":65,\"height\":65},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":75},\"140x90c\":{\"format\":\"jpg\",\"width\":140,\"height\":90},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 31314, '', '', 687, 712170749, '2018-02-15 04:02:12', '2018-02-15 04:02:20', 1, 1, 0, '', 1, 0, 0, 0, 0),
