(2468, 'video', NULL, 1921, 0, 'com_content', 'YonoS8_pAjU-v1519544751', 'jpg', 'original/47/34/85/', 'Khách hàng nói về sâm Alipas Platium', 'Không còn nghi ngờ gì nữa, sâm Alipas Platium chính là bí quyết cứu vãn, phục hồi phong độ cho hàng triệu nam giới từ U40, 50, 60 thậm chí U70 trong mọi “trận chiến”. Không chỉ có U23 mới có thể làm say đắm hàng triệu trái tim các chị em, bởi nếu nam giới biết cách sử dụng “bảo bối” phục hồi sinh lực an toàn và bền vững này, thì dù không đủ 6 múi nhưng cũng khiến chị em... mê tít.', 114, 0, '{\"image\":{\"format\":\"jpg\",\"width\":\"\",\"height\":\"\"},\"thumbnail\":{\"65x65c\":{\"format\":\"jpg\",\"width\":65,\"height\":65},\"100x100s\":{\"format\":\"jpg\",\"width\":100,\"height\":75},\"140x90c\":{\"format\":\"jpg\",\"width\":140,\"height\":90},\"640x640s\":{\"format\":\"jpg\",\"width\":480,\"height\":360}}}', 'youtube', 31314, '', '', 639, 1984419035, '2018-02-25 07:45:51', NULL, 1, 1, 0, '', 1, 0, 0, 0, 0),
