INSERT INTO `rate_jreviews_paid_emails` (`email_id`, `name`, `description`, `trigger`, `subject`, `body`, `admin_emails`, `state`, `ordering`, `payment_type`) VALUES
(1, 'Admin Order Placed', 'Triggered when an order is first placed', 'admin_order_placed', 'New paid listing order #{order_id} - {order_amount}', 'A new order has been received for a paid listing. Below you\'ll find the complete details for this order.\n\nUser: {user_name}\nTitle: {listing_title}\nUrl: {listing_url}\nAmount: {order_amount}\nPlan: {plan_name}\n', '', 0, 1, 0),
(2, 'Admin Order Processed', 'Triggered when a payment is received', 'admin_order_processed', 'Paid listing order #{order_id} was processed', 'A payment attempt was made for order #{order_id}. Below you\'ll find the complete order and transaction details:\n\nUser: {user_name}\nTitle: {listing_title}\nUrl: {listing_url}\nAmount: {order_amount}\nPlan: {plan_name}\n\nTransaction Details\n\n{txn_array}\n', '', 0, 2, 0),
(3, 'User Order Placed', 'Triggered when an order is first placed', 'user_order_placed', 'Your order confirmation for: {listing_title}', 'Dear {user_name},\n\nThank you for submitting your listing, {listing_title}, to our website. An order was created for this paid listing with Order#{order_id}. However, you still need to complete the payment for this order before the listing is published on the site.\n\nBelow the complete details of your order:\n\nListing: {listing_title}\nUrl: {listing_url}\nAmount: {order_amount}\nPlan: {plan_name} - {plan_description}\nOrder expires: {order_expires}\nOrder amount:{order_amount}\n\nThank you,\n\nThe Administration\n{site_url}', '', 0, 3, 0),
(4, 'User Order Processed', 'Triggered when payment handler notifies script of payment results', 'user_order_processed', 'Payment received for: {listing_title}', 'Dear {user_name},\n\nWe have received your payment for the following order #{order_id} and your listing will now be published.\n\nListing: {listing_title}\nUrl: {listing_url}\nAmount: {order_amount}\nPlan: {plan_name} - {plan_description}\nOrder expires: {order_expires}\nOrder amount:{order_amount}\n\nThank you,\n\nThe Administration\n{site_url}', '', 0, 4, 0),
(6, 'User Order Expiration Notice 1', 'This is the first expiration notice sent before order expiration.', 'user_order_expiration1', 'Expiring soon: {listing_title}', 'Dear {user_name},\n\nWe wanted to remind you that your listing, {listing_title}, is expiring soon. Please head over to {site_url} and renew the listing in the MyAccount page.\n\nBest regards,\n\nThe Administration\n{site_url}', '', 0, 5, 0),
(7, 'User Order Expiration Notice 2', 'This is the second expiration notice sent before order expiration.', 'user_order_expiration2', 'Final expiration notice for: {listing_title}', 'Dear {user_name},\n\nWe wanted to notify you one last time that your listing, {listing_title}, is about to expire. Please head over to {site_url} and renew the listing in the MyAccount page.\n\nBest regards,\n\nThe Administration\n{site_url}', '', 0, 6, 0),
(10, 'User Payment Successful', 'Triggered when payment handler notifies the script of a successful subscription payment', 'user_payment_success', 'Payment received for: {listing_title}', 'Dear {user_name},\r\n\r\nWe have received your subscription payment for order #{order_id} and your listing will now be published.\r\n\r\nListing: {listing_title}\r\nUrl: {listing_url}\r\nAmount: {order_amount}\r\nPlan: {plan_name} - {plan_description}\r\nOrder expires: {order_expires}\r\nOrder amount:{order_amount}\r\n\r\nThank you,\r\n\r\nThe Administration\r\n{site_url}', '', 0, 8, 1),
(11, 'User Subscription Created', 'Triggered when the payment handler notifies the script of a successful subscription creation', 'user_subscription_created', 'Your order confirmation for: {listing_title}', 'Dear {user_name},\r\n\r\nThank you for submitting your listing, {listing_title}, to our website. A subscription order was created for this paid listing with Order#{order_id}. We will now attempt to process your first payment for this subscription.\r\n\r\nBelow the complete details of your order:\r\n\r\nListing: {listing_title}\r\nUrl: {listing_url}\r\nAmount: {order_amount}\r\nPlan: {plan_name} - {plan_description}\r\nOrder expires: {order_expires}\r\nOrder amount:{order_amount}\r\n\r\nThank you,\r\n\r\nThe Administration\r\n{site_url}', '', 0, 5, 1),
(12, 'Admin Payment Successful', 'Triggered when payment handler notifies the script of a successful subscription payment', 'admin_payment_success', 'Payment received for paid listing subscription order #{order_id}', 'A successful payment attempt was made for subscription order #{order_id}. Below you\'ll find the complete order and transaction details:\r\n\r\nUser: {user_name}\r\nTitle: {listing_title}\r\nUrl: {listing_url}\r\nAmount: {order_amount}\r\nPlan: {plan_name}\r\n\r\nTransaction Details\r\n\r\n{txn_array}\r\n', '', 0, 3, 1),
(13, 'Admin Subscription Created', 'Triggered when the payment handler notifies the script of a successful subscription creation', 'admin_subscription_created', 'New paid listing subscription order #{order_id} - {order_amount}', 'A new order has been received for a paid listing subscription. Below you\'ll find the complete details for this order.\r\n\r\nUser: {user_name}\r\nTitle: {listing_title}\r\nUrl: {listing_url}\r\nAmount: {order_amount}\r\nPlan: {plan_name}\r\n', '', 1, 1, 1),
(14, 'Admin Payment Failure', 'Triggered when payment handler notifies the script of a failed subscription payment', 'admin_payment_failure', 'Failed payment for paid listing subscription order #{order_id}', 'A failed payment attempt was made for subscription order #{order_id}. Below you\'ll find the complete order and transaction details:\r\n\r\nUser: {user_name}\r\nTitle: {listing_title}\r\nUrl: {listing_url}\r\nAmount: {order_amount}\r\nPlan: {plan_name}\r\n\r\nTransaction Details\r\n\r\n{txn_array}\r\n', '', 0, 4, 1),
(15, 'User Payment Failure', 'Triggered when payment handler notifies the script of a failed subscription payment', 'user_payment_failure', 'Subscription payment failed for: {listing_title}', 'Dear {user_name},\r\n\r\nWe have attempted to process your subscription payment for order #{order_id} but the payment has failed.\r\n\r\nTo prevent your listing from expiring, please make sure you have a valid payment method listed on your My Account page, Payment Methods tab, {handler_name} section.\r\n\r\nListing: {listing_title}\r\nUrl: {listing_url}\r\nAmount: {order_amount}\r\nPlan: {plan_name} - {plan_description}\r\nOrder expires: {order_expires}\r\nOrder amount:{order_amount}\r\n\r\nThank you,\r\n\r\nThe Administration\r\n{site_url}', '', 0, 9, 1),
(16, 'User Upcoming Payment', 'Triggered when payment handler notifies the script of an upcoming subscription payment', 'user_payment_upcoming', 'Upcoming payment for: {listing_title}', 'Dear {user_name},\r\n\r\nWe will soon process your subscription payment for order #{order_id}.\r\n\r\nPlease make sure you have a valid payment method listed on your My Account page, Payment Methods tab, {handler_name} section.\r\n\r\nListing: {listing_title}\r\nUrl: {listing_url}\r\nAmount: {order_amount}\r\nPlan: {plan_name} - {plan_description}\r\nOrder expires: {order_expires}\r\nOrder amount:{order_amount}\r\n\r\nThank you,\r\n\r\nThe Administration\r\n{site_url}', '', 0, 7, 1),
(18, 'Admin Subscription Cancelled', 'Triggered when the payment handler notifies the script of a subscription cancellation', 'admin_subscription_cancelled', 'Cancelled subscription order #{order_id}', 'The following paid listing subscription has been cancelled by the user. Below you\'ll find the complete details for this cancelled order.\r\n\r\nUser: {user_name}\r\nTitle: {listing_title}\r\nUrl: {listing_url}\r\nAmount: {order_amount}\r\nPlan: {plan_name}\r\n\r\nTransaction details\r\n\r\n{txn_array}', '', 0, 2, 1),
(19, 'User Subscription Cancelled', 'Triggered when the payment handler notifies the script of a subscription cancellation', 'user_subscription_cancelled', 'Your cancellation confirmation for: {listing_title}', 'Dear {user_name},\r\n\r\nYour subscription order #{order_id} has been cancelled per your request. You will no longer be billed for this subscription. Your plan benefits will remain active until {order_expires}.\r\n\r\nBelow the complete details of your order:\r\n\r\nListing: {listing_title}\r\nUrl: {listing_url}\r\nAmount: {order_amount}\r\nPlan: {plan_name} - {plan_description}\r\nOrder expires: {order_expires}\r\nOrder amount:{order_amount}\r\n\r\nThank you,\r\n\r\nThe Administration\r\n{site_url}', '', 0, 6, 1),
(20, 'User Subscription Expiration Notice 1', 'This is the first expiration notice sent before subscription expiration.', 'user_subscription_expiration1', 'Expiring soon: {listing_title}', 'Dear {user_name},\n\nWe wanted to remind you that your subscription for listing, {listing_title}, is expiring soon. Please head over to {site_url} and renew the subscription in the MyAccount page.\n\nBest regards,\n\nThe Administration\n{site_url}', '', 0, 9, 1),
(21, 'User Subscription Expiration Notice 2', 'This is the second expiration notice sent before subscription expiration.', 'user_subscription_expiration2', 'Final expiration notice for: {listing_title}', 'Dear {user_name},\n\nWe wanted to notify you one last time that your subscription for listing, {listing_title}, is about to expire. Please head over to {site_url} and renew the subscription in the MyAccount page.\n\nBest regards,\n\nThe Administration\n{site_url}', '', 1, 10, 1),
(22, 'Admin Subscription Expiration Notice 1', 'This is the first expiration notice sent before subscription expiration.', 'admin_subscription_expiration1', 'Expiring soon: {listing_title} subscription', 'Dear {admin_name},\n\nWe wanted to remind you that the subscription for listing, {listing_title}, is expiring soon. Please head over to {site_url} and renew the subscription in the admin panel.\n\nBest regards,\n\nThe Administration\n{site_url}', '', 0, 11, 1),
(23, 'Admin Subscription Expiration Notice 2', 'This is the second expiration notice sent before subscription expiration.', 'admin_subscription_expiration2', 'Final expiration notice for: {listing_title} subscription', 'Dear {admin_name},\n\nWe wanted to notify you one last time that the subscription for listing, {listing_title}, is about to expire. Please head over to {site_url} and renew the subscription in the admin panel.\n\nBest regards,\n\nThe Administration\n{site_url}', '', 1, 12, 1),
(24, 'User Subscription Canceled', 'Triggered when a user cancels their subscription', 'user_subscription_canceled', 'Your subscription for {listing_title} has been canceled', 'Dear {user_name},\n\nWe wanted to inform you that your subscription for listing, {listing_title}, has been canceled. Your listing will be unpublished on our website on {subscription_end_date}.\n\nIf you wish to renew your subscription, please head over to {site_url} and renew the subscription in the MyAccount page.\n\nBest regards,\n\nThe Administration\n{site_url}', '', 0, 13, 1);
