(16, '', '', '- Thiết kế đẹp.\n- Màn hình rực rỡ.\n- Hỗ trợ 4G LTE.\n- Thời lượng pin tốt.', '- Ứng dụng Maps chưa thuyết phục.\n- Màn hình lơn hơn do vậy chưa tương thích một vài ứng dụng.\n- iOS 6 không có gì mới lạ.', ''),
(17, '', '', '', '', ''),
(19, '', '', '- Màn hình rực rỡ\n- Thời lượng pin tốt\n- Máy ảnh trang bị công nghệ PureView\n- Windows Phone 8', '- Máy khá lớn, nặng\n- Khởi động chậm\n- Sạc không dây chưa thực sự hữu dụng', ''),
(20, '', '', '- Thiết kế tuyệt đẹp\n- Cấu hình mạnh\n- Android 4.2', '- Thiếu LTE 4G\n- Dễ trầy', ''),
(21, '', '', 'Sennheiser HD 700 là một mẫu headphone audiophile kích thước lớn với dải tần số mở rộng, cho âm thanh tuyệt vời trên những máy nghe nhạc điện tử.', 'HD 700 vô cùng đắt, vì thế một số người mua có thể lưỡng lự trước tỷ lệ thành phần nhựa được sử dụng trong thiết kế.', ''),
(22, '', '', '- Sức mạnh vượt trội\n- Camera chụp ảnh tuyệt đẹp\n- Thiết kế đậm chất kỹ thuật\n- Những tinh chỉnh trong Android mang lại nhiều lợi ích', '- Người mới dùng chưa thể quen ngay với giao diện TouchWiz\n- S Voice như thể được sao chép lại từ Siri\n- Samsung thường xuyên lỡ hẹn cập nhật điện thoại', ''),
(23, '', '', '- Thiết kế đẹp mắt\n- Thích hợp duyệt web, đọc sách, chơi game\n- Thời lượng pin tốt\n- iOS 6', '- Bàn phím ảo nhỏ\n- Vị trí loa không hợp lý\n- Tỉ lệ màn hình 4:3, độ phân giải 1024x576\n- Màn hình bị lóa', ''),
(24, '', '', '• Ngoại hình đẹp\n• Chạy WP8\n• Máy chạy nhanh, hiệu năng tốt\n• Font chữ rõ ràng, dễ đọc\n• Giá tốt\n• Có sẵn bộ gõ tiếng Việt ', '• Nút nguồn hơi khó bấm\n• Màn hình ngả vàng nhiều\n• Chưa hỗ trợ gõ Telex\n• Chưa hỗ trợ khóa xoay màn hình ', ''),
(25, '', '', '- Hoạt động trơn tru\n- Giao diện bắt mắt\n- Vi xử lý lõi kép tốc độ cao (1000 MHz)\n- Màn hình có mật độ pixel cao, 265 ppi\n- Trang bị kết nối NFC\n- Kích thước nhỏ gọn', '- Chất lượng ảnh chụp ở mức trung bình\n- Hệ điều hành Android 2.3 Gingerbread\n- Không có máy ảnh ở mặt trước', ''),
(26, '', '', '- Cấu trúc cao cấp\n- Màn hình Retina vô cùng sắc nét\n- Hiệu năng mạnh mẽ\n- Thời lượng pin trên mức trung bình\n- Vi xử lý lõi kép tốc độ cao (1.4 GHz)\n- Dung lượng RAM lớn (1GB)\n- Mật độ điểm ảnh cao (264 ppi)\n- Hỗ trợ kết nối 4G\n- Trang bị kết nối HDMI ', '- Không khác biệt iPad 3 là mấy\n- Máy ảnh không có đèn flash\n- Không thể mở rộng bộ nhớ hơn nữa\n- Cổng kết nối USB riêng, nên phải sử dụng loại cáp nối đặc biệt thay vì cáp microUSB tiêu chuẩn. ', ''),
(27, '', '', 'Màn hình độ phân giải cao chừa từng có trên Macbook Pro mới với màn hình Retina khiến cho hình ảnh, và cả nét chữ đơn giản, trông vô cùng sắc nét. Mặc dù được thiết kế lại, cấu trúc nhẹ, các thành phần mạnh mẽ, bao gồm một GPU Nvidia, có thể sánh ngang với những mẫu máy tính để bàn cao cấp. Bên cạnh đó, Macbook Pro Retina còn được trang bị các cổng kết nối mới, gồm có USB 3.0 và HDMI. ', 'Với mức giá $2,199 cho phiên bản thấp nhất, Macbook Pro Retina có giá bán rất cao. Đồng thời, thiếu giắc cắm Ethernet, FireWire, hay một ổ đĩa quang có thể là những trở ngại. Mặc dù mỏng hơn, nhẹ hơn, Macbook Pro Retina không dễ di chuyển như một ultrabook hay Macbook Air. ', ''),
(28, '', '', '- Cấu trúc chắc chắn và thiết kế chất lượng tốt\n- Thời lượng pin tuyệt vời\n- Các cổng USB kích thước chuẩn\n- Có khả năng chạy đồng thời hai ứng dụng\n- Vi xử lý lõi tứ tốc độ 1.3 GHz\n- RAM lớn (2GB) ', '- Màn hình đẹp nhưng có độ phân giải thấp\n- Khả năng chụp ảnh và quay phim kém\n- Số lượng các ứng dụng của bên thứ 3 rất hạn chế\n- Mật độ điểm ảnh của màn hình thấp (148 ppi)\n- Máy ảnh thiếu tính năng tự động lấy nét\n- Máy ảnh thiếu đèn flash ', ''),
(29, '', '', '- Màn hình độ phân giải cực cao\n- Mức giá thấp, chỉ $400\n- Thời lượng pin khủng\n- Vi xử lý lõi kép tốc độ 1.7 GHz\n- Dung lượng RAM lớn (2GB)\n- NFC\n- Kết nối HDMI ', '- Không có kết nối 4G/ 3G\n- Một số ứng dụng gặp lỗi với Android 4.2\n- Không có khe cắm thẻ nhớ để mở rộng bộ nhớ ', ''),
(32, '', '', 'Bên cạnh một ống kinh chuyển động nhanh và tuyệt vời, Canon PowerShot G15 mang thiết kế bắt mắt cùng khả năng chụp ảnh rất đẹp.', 'Các tính năng có phần bị giới hạn và hiệu năng không được tốt.', ''),
(33, '', '', '- Kết nối LTE\n- Mỏng, nhẹ, bắt mắt\n- Hiệu năng tuyệt vời\n- Vi xử lý lõi kép tốc độ cao (1.2 GHz)\n- RAM lớn (1GB)\n- Màn hình lớn (4.3 inch)\n- Hỗ trợ kết nối 4G tốc độ cao\n- Có 2 chế độ CDMA/ GSM\n- NFC\n- Kết nối HDMI', '- Máy ảnh không thực sự ấn tượng\n- Chất lượng cuộc gọi chưa tốt\n- Độ phân giải màn hình chỉ có 800 x 480 pixel', ''),
(34, '', '', 'Sáng tạp, trẻ trung, thanh lịch \nMáy khỏe\nXe đầm\nTiết kiệm nhiên liệu (khuyến cáo người dùng nên sử dụng xăng A95 để tận dụng hết công suất máy)\nLốp không săm\nCốp lớn\nĐèn sáng\nPhanh an toàn', 'Thiết kế một vài chỗ chưa hợp lý\nCòn bị làm giá', ''),
(37, '', '', '- Giao diện WP8\n- Pin rời\n- Hỗ trợ thẻ nhớ\n- Hỗ trợ 4G LTE\n- Thời lượng pin tốt', '- Đa nhiệm vụng về', ''),
(38, '', '', '- Màn hình sặc sỡ\n- Hiệu năng mạnh mẽ\n- Các ứng dụng Nokia tuyệt vời, bộ Office tích hợp\n- Vi xử lý lõi kép\n- Hỗ trợ kết nối mạng tốc độ cao (4G)\n- NFC', '- Thân hình hơi lớn\n- Thời lượng pin cần được cải thiện', ''),
(39, '', '', '- Thiết kế bắt mắt.\n- Khả năng kháng bụi và nước.\n- Được trang bị kết nối LTE.\n- Mức giá phải chăng.\n- Vi xử lý lõi kép mạnh mẽ.\n- Trọng lượng nhẹ.', '- Chỉ có dung lượng bộ nhớ 8GB.\n- Thời gian sử dụng pin ngắn.', ''),
(40, '', '', '+ Thiết kế nhẹ và mỏng\n+ Màn hình lớn\n+ Pin dung lượng cao hơn sản phẩm đối thủ\n+ Nhiều tùy chọn bộ nhớ trong và hỗ trợ thẻ nhớ ngoài\n+ Windows Phone 8 đem lại trải nghiệm mượt mà', '- Kho ứng dụng Windows Phone nghèo nàn\n- Mặt sau máy nhiều chữ và rườm rà\n- Bàn phím ảo hẹp khi xoay máy theo chiều ngang\n- Giá khá đắt', ''),
(41, '', '', '+ Windows Phone 8 hoạt động mượt\n+ Màn hình hiển thị màu chuẩn, chống chói tốt\n+ Camera chụp ảnh khá đẹp\n+ Giá hấp dẫn', '- Dung lượng pin hơi nhỏ\n- Không hỗ trợ gõ tiếng Việt theo kiểu VNI và Telex', ''),
(42, '', '', '+ Được nâng cấp toàn diện về cấu hình cũng như giao diện, đủ để thõa mãn người dùng thông thường và doanh nhân.\n+ Camera tốt\n+ Giao diện OS sắc sảo, tiện dụng\n+ Bảo mật cao', '- Giao diễn chưa đột phá\n- Ứng dụng bản đồ chưa tốt\n- Kho ứng dụng nghèo nàn\n- Hệ điều hành còn mới\n- Pin chưa thật sự tốt như mong đợi', ''),
(43, '', '', '- Nhẹ và gọn hơn Galaxy Note II.\n- Thời lượng pin khá.\n- Nhiều tính năng hỗ trợ thông minh.\n- Camera chất lượng.', '- Kích thước lớn nên khá kén người dùng.\n- Chất lượng đàm thoại còn hạn chế.\n- Chế độ tự điều chỉnh độ sáng màn hình hoạt động chưa tốt.', ''),
(44, '', '', '. Kiểu dáng gọn gàng, cứng cáp, có dấu ấn riêng ở thiết kế mẫu mã từng loại.\n. Compact design đầy đủ chức năng như một bàn phím fullsize.\n. Multimedia phong phú.\n. Full backlit với nhiều chế độ sáng.\n. Plug & play - cắm là xài.\n. Switch 6KRO/NKRO qua cổng USB - chỉ có ở CM Storm backlit mechkey.\n. Window-key lock, không thể thiếu cho một gaming keyboard.\n. Chỉ cần 1 cổng USB để cấp điện.\n. Dây cáp bọc dù mạ vàng đầu USB và có thể tháo rời, tuỳ biến lắp dây khá tiện dụng.\n. Keycap phủ coating chống trượt khá dày.\n. Giá tốt trong phân khúc tầm trung : 2.100.000 VND', '. Keycap phủ coating dày nên phím bấm có cảm giác hơi cứng.\n. FN-lock lợi nhưng không tiện, quên tắt chẳng mấy chốc thành loser.\n. Puller đi kèm là loại ring-puller, tháo nhiều lần sẽ bị xước keycap.\n. Sách hướng dẫn sơ sài.\n. Không có nắp nhựa chắn bụi như QuickFire Pro.', ''),
(45, '', '', '', '', ''),
(47, '', '', '- Thiết bị Android cao cấp nhỏ gọn nhất\n- Sử dụng thẻ SIM thông thường, có khe cắm thẻ microSD và có thể tháo pin được\n- Những tính năng mới hữu ích như Quick Memo, Media Plex và Time Machine\n- Vi xử lý lõi tứ tốc độ 1.5GHz\n- RAM lớn (1GB)\n- Màn hình rất lớn (4.7 inch)\n- Mật độ điểm ảnh rất cao (312 ppi)\n- Màn hình có độ phân giải cao (720 x 1280 pixel)\n- Máy ảnh độ phân giải cao (8 megapixel)\n- Hỗ trợ kết nối 4G tốc độ cao\n- Trang bị kết nối NFC\n- Có thể kết nối với TV qua cổng microUSB bằng dây nối HDMI', '- Khả năng lấy nét của máy ảnh không chính xác\n- Chức năng điều chỉnh độ sáng tự động chỉ hoạt động trong một khoảng nhất định\n- Không có LTE', ''),
(48, '', '', '- Hình dáng đẹp\n- Khả năng chịu nước\n- Hiệu suất cao\n- Camera cực tốt', '- Pin chưa tốt\n- Góc nhìn kém\n- Không có Android 4.2 ngay từ đầu', ''),
(49, '', '', '- Rất gọn và nhẹ dù có màn hình lớn\n- Cục pin dung lượng lớn 3140 mAh\n- Thiết kế có thể tháo ra được cho phép bạn bổ sung bộ nhớ hoặc đổi pin\n- QButton và IR blaster có thể được cài đặt cho các tình huống sử dụng khác nhau\n- Khả năng chụp ảnh và quay phim tốt\n- Vi xử lý lõi tứ\n- Màn hình lớn (5.5 inch)\n- Mật độ điểm ảnh vô cùng cao (401 ppi)\n- Màn hình có độ phân giải cao (1080 x 1920 pixel)\n- Máy ảnh độ phân giải cao (13 megapixel)\n- Vi xử lý tốc độ nhanh 1.7 GHz\n- RAM dung lượng lớn (2GB)\n- Hỗ trợ kết nối di động tốc độ nhanh (4G)\n- NFC\n- Kết nối HDMI', '- Màn hình quá lớn để sử dụng dễ dàng bằng một tay\n- Chất lượng âm thanh không thực sự tốt\n- Chức năng tự động điều chỉnh độ sáng không được chính xác', ''),
(50, '', '', '- Màn hình hiển thị đẹp\n- Cảm giác cầm chắc tay\n- Pin có khả năng thay', '- Ít ứng dụng\n- Khởi động và tắt máy chậm\n- Loa bé', ''),
(51, '', '', '- Thiết kế chắc chắn\n- Màn hình 1080p\n- Hiệu suất cao', '- Pin yếu\n- Quạt gây tiếng ồn', ''),
(52, '', '', '- Thiết kế bằng nhôm chắc chắn\n- Màn hình 4.7 inch sáng rõ, độ phân giải 1080p\n- Âm thanh chân thực, sống động\n- Hiệu năng trơn tru\n- Vi xử lý lõi tứ 1.7 GHz\n- Màn hình có mật độ điểm ảnh cực cao, 468 ppi\n- RAM lớn (2GB)\n- Hỗ trợ kết nối dữ liệu tốc độ cao 4G\n- Trang bị kết nối NFC\n- Có kết nối HDMI tới TV', '- Không có khe cắm thẻ microSD', ''),
(54, '', '', '- Màn hình đẹp, độ phân giải cao\n- Chất lượng hoàn thiện tốt\n- Bàn phím và trackpad tuyệt vời', '- Chức năng của hệ điều hành còn hạn chế\n- Thời lượng pin kém\n- Giá cao', ''),
(55, '', '', '+ Kết nối WiFi, GPS\n+ Dải ISO rộng, hỗ trợ khử nhiễu tốt\n+ Chế độ màn trập im lặng\n+ Tính năng quay phim tốt\n+ Chế độ chụp ảnh sáng tạo, HDR\n+ Thân máy nhẹ\n+ Tuổi thọ pin tốt\n+ Giá hấp dẫn', '- Chỉ có 11 điểm lấy nét tự động và 1 điểm Cross-type\n- Chỉ có một khe thẻ nhớ SD\n- Các nút bấm không cứng cáp\n- Độ phân giải cảm biến thấp so với các máy full-frame', ''),
(56, '', '', '- Có các ứng dụng Nokia tuyệt vời\n- Vi xử lý lõi kép\n- Màn hình lớn, 4.3 inch\n- Máy ảnh độ phân giải cao (8 megapixel)\n- Vi xử lý mạnh mẽ (1.5 GHz)\n- Dung lượng RAM lớn (1GB)\n- Trang bị kết nối 4G\n- NFC', '- Máy ảnh chất lượng kém\n- Chất lượng cuộc gọi dưới chuẩn\n- Cón rất ít ứng dụng thứ 3', ''),
(58, '', '', '- Kiểu dáng đẹp như không \"lạ\", nếu tinh ý có thể thấy ngay được sự pha trộn design giữa Razer, Steelseries và Logitech.\n- Driver nhẹ, dễ dùng, chức năng tích hợp phong phú tiện dụng, đáng giá nhất là memory onboard, và cũng pha trộn tinh hoa của những gã khổng lồ đi trước. Cụ thể : \na. Macro buttons, switch buttons (profile, polling rate), led và battle-led của Razer.\nb. On-the-fly sensitivity button của Steelseries.\nc. Weight-in (tạ) và DPI-led của Logitech.\nCuối cùng dấu ấn của Tt.Esports ở Theron chắc chỉ còn lại lock/unlock macro button.\n- Laser sensor tracking ổn định ở mọi mức DPI.\n- Teflon feet dày, đặc và mượt.', '- Trọng lượng thực vẫn nặng so với tay gamer RTS châu á.\n- Không dành cho Claw grip, cầm khá khó chịu.\n- Là mouse recommend for RTS nhưng mouse 1 vẫn hơi cứng, mouse 1+2 không có độ sâu.\n- Không thể gán trực tiếp macro vào nút, mà phải tạo profile trước và chọn trong danh sách profile, khá bât tiện.\n- Phủ coating gần như toàn bộ body, dùng một thời gian xuống mã tệ hại.\n- Design \"tát gầu sòng\" same same Abyssus.', ''),
(59, '', '', '', '', ''),
(60, '', '', 'Ưu điểm\n-Màn hình tuyệt đẹp\n-Hiệu năng tốt', 'Nhược điểm\n-To và nặng so với các ultrabook hiện nay\n-không kiểu cách', ''),
(86, '', '', '', '', ''),
(87, '', '', '+ Giá hấp dẫn\n+ Máy sử dụng nhanh, mượt\n+ Chất lượng màn hình, máy ảnh đều khá', '- Thời gian sử dụng pin không ấn tượng\n- Thiếu camera mặt trước và đèn flash, sẽ bất tiện trong một số trường hợp nhất định', ''),
(88, '', '', '- Thiết kế độc đáo và chắc chắn\n- Chất lượng cuộc gọi tuyệt vời\n- Kết nối 4G LTE\n- Vi xử lý mạnh mẽ (1.4GHz) \n- Màn hình kích thước lớn (4.30 inch)\n- Máy ảnh có độ phân giải cao (8 megapixe)', '- Khả năng chụp ảnh và quay phim ở mức trung bình', ''),
(62, '', '', '- Màn hình độ phân giải siêu cao, sắc nét\n- Thiết kế chắc chắn\n- Thời lượng pin cao', '- Android và các ứng dụng chưa được tối ưu toàn bộ để tương thích với bàn phím\n- Không có cổng microUSB\n- Chưa được nâng cấp lên Jelly Bean', ''),
(63, '', '', '- Thiết kế tuyệt đẹp\n- Cấu hình mạnh\n- Android 4.2', '- Thiếu LTE 4G', ''),
(64, '', '', '- Có khả năng lấy lại nét cho các bức ảnh sau khi chụp\n- Cấu trúc vững chắc\n- Giao diện đơn giản nhưng hết sức trực quan\n', '- Độ phân giải ảnh thấp (xấp xỉ 1MP)\n- Màn hình không đẹp\n- Khả năng chụp ảnh kém khi ánh sáng yếu\n- Chưa có phần mềm tương thích với Windows', ''),
(65, '', '', 'Nikon Coolpix S800c là một chiếc máy ảnh ‘bấm và chụp’ nhỏ nhắn, chạy hệ điều hành Android, được trang bị một màn hình cảm ứng, Wi-Fi, GPS và có thể truy cập vào Google Playstore cũng như sử dụng tất cả các ứng dụng và nội dung số mà bạn có thể tìm thấy trên những thiết bị Android khác.', 'Chiếc S800c như thể một chiếc máy ảnh với một chiếc smartphone Android dính vào. Thời lượng pin rất ngắn. Chất lượng hình ảnh không tốt hợp chiếc Coolpix S6300 là bao.', ''),
(66, '', '', '- Giá rẻ\n- Thời lượng pin tốt\n- Thiết kế chắn chắc và dễ cầm\n', '- Độ phân giải thấp\n- Vi xử lý khá chậm\n- Chất lượng âm thanh từ loa thoại không tốt\n- Không có máy ảnh mặt trước\n- Các góc nhìn của màn hình rất hẹp', ''),
(67, '', '', '', '', ''),
(68, '', '', '', '', ''),
(69, '', '', 'Lối lên rất là huyền bí, đó là cầu thang dẫn lên một chung cư cũ nên đi buổi tối 1 mình thì sẽ sợ lắm. Mình nghĩ chỗ này thích hợp tổ chức Halloween nè.\nKhông gian trong quán khá là cute, ngồi kiểu Nhật với các gối nệm.', 'Thức uống thì cũng bình thường, chưa gây ấn tượng lắm.', ''),
(70, '', '', '', '', ''),
(71, '', '', '', '', ''),
(72, '', '', '', '', ''),
(73, '', '', '- Tính năng hai SIM hai sóng\n- Android 4.0 Ice Cream Sandwich\n- Vi xử lý tốc độ cao (1GHz)\n- RAM lớn (768 MB)', '- Lớp vỏ bằng nhựa rẻ tiền\n- Vi xử lý lõi đơn lỗi thời\n- Không thể quay phim 720p\n- Thiếu cảm biến ánh sáng để tự động điều chỉnh độ sáng màn hình', ''),
(74, '', '', '- Thiết kế lịch lãm và nhỏ gọn\n- Sử dụng hệ điều hành Android 4.1 Jelly Bean\n- Vi xử lý lõi kép \n- Dung lượng RAM lớn (1GB)\n- Kết nối NFC', '- Khả năng quay phim bình thường\n- Các nút bấm cứng cần được cải thiện', ''),
(75, '', '', '- Bộ nhớ 32GB \n- Camera tốc độ cao với chất lượng ảnh và video rất tốt\n- Màn hình HD có mật độ điểm ảnh lớn\n- Thiết kế độc đáo với một dải trong suốt\n- Chất lượng cuộc gọi tốt', '- Các nút bấm cảm ứng bé tí và không nhạy\n- Kích thước 4.3 inch hơi lớn\n- Các góc nhìn màn hình theo chiều ngang không thực sự tốt', ''),
(76, '', '', '- Thiết kế bắt mắt \n- Màn hình IPS chất lượng cao\n- Chất lượng gọi điện rất tốt\n- Hiệu năng mạnh mẽ\n- Vi xử lý lõi kép 1GHz\n- RAM 1GB', '- Máy ảnh 5MP không thực sự tốt', ''),
(78, '', '', '- Màn hình đẹp\n- Thời lượng pin tương đối lâu\n- Mức giá phải chăng\n- Vi xử lý nhanh (1000 MHz)\n- Kích thước nhỏ gọn', '- Hiệu năng dưới mức trung bình\n- Máy ảnh tệ hại\n- Thiếu cảm biến ánh sáng đồng nghĩa bạn phải tự mình điều chỉnh độ sáng màn hình\n- Các nút bấm cứng không nhạy', ''),
(79, '', '', '- Sử dụng hệ điều hành Android 4.0 Ice Cream Sandwich\n- Màn hình lớn với mật độ pixel cao\n- Vi xử lý tốc độ nhanh (1000 MHz)\n- Trang bị kết nối HDMI', '- Thỉnh thoảng bị giật\n- Lớp vỏ bằng nhựa tạo cảm giác rẻ tiền', ''),
(80, '', '', 'Ngon, khẩu vị nêm thức ăn có vẻ theo Âu chứ chưa bị lai Việt nên ăn lạ miệng thích lắm.', 'Điểm trừ là nằm trong góc khuất, mỗi lần vào Vicom đi kiếm lâu', ''),
(81, '', '', '', '', ''),
(82, '', '', '', '', ''),
(83, '', '', '', '', ''),
(84, '', '', '- Thiết kế đẹp và cao cấp\n- Màn hình khá tốt\n- Pin lâu, có thể được 1 ngày rưỡi\n- Có sạc không dây (gắn thêm vỏ riêng)\n- Có NFC', '- RAM chỉ có 512MB\n- Camera cho màu sắc chưa được tự nhiên\n- Font chữ hơi rổ do độ phân giải màn hình hơi thấp', ''),
(89, '', '', '- Giao diện nhạy bén\n- Chất lượng ảnh cao\n- Nhỏ gọn', '- Màn hình có chất lượng dưới mức trung bình\n- Trình duyệt web chưa tốt', ''),
(90, '', '', '- Chống nước và chống bụi\n- Vi xử lý lõi kép 1GHz\n- Khả năng quay phim HD tốt', '- Chất liệu bằng nhựa rẻ tiền\n- Màn hình có độ phân giải thấp', ''),
(91, '', '', '- Thiết kế thanh lịch\n- Vi xử lý lõi kép 1.5GHz\n- Dung lượng RAM lớn (1024 MB RAM)\n- Màn hình lớn (4.30 inch)\n- Màn hình có mật độ điểm ảnh cao (342 ppi)\n- Màn hình có độ phân giải cao (1280 x 720 pixel)\n- Máy ảnh độ phân giải cao (8 megapixel)\n- Hỗ trợ kết nối 4G tốc độ cao\n- Mẫu điện thoại quốc tế tương thích với tất cả mạng GSM/UMTS trên thế giới\n- Được trang bị kết nối NFC\n- Mức giá chấp nhận được', '- Có ít cải tiến trong Windows Phone 8\n- Loa yếu\n- Thiếu hỗ trợ thẻ nhớ microSD để mở rộng bộ nhớ', ''),
(92, '', '', '+ Màn hình Full HD hiển thị rất tốt\n+ Kiểu dáng đẹp, thiết kế chắc chắn\n+ Hiệu năng cao', '- Một số chi tiết thiết kế chưa hợp lý\n- Máy nóng, pin kém khi sử dụng để chơi game', ''),
(93, '', '', '', '', ''),
(94, '', '', 'Thiết kế mỏng, nhẹ và trang nhã cho một điện thoại tầm trung\n\nCamera 8.0 Megapixels đem lại chất lượng ảnh khá tốt, cùng với khả năng quay phim 1080p\n\nMàn hình Super AMOLED Plus đem lại hình ảnh có màu sắc tươi sáng.\n\nGóc nhìn rộng.', 'Độ phân giải và mật độ điểm ảnh thấp cho một chiếc smartphone có màn hình 4.3\"', ''),
(95, '', '', '', '', ''),
(96, '', '', '+ Mỏng\n+ Nhẹ\n+ Độ phân giải cao, mạnh mẽ', '- Nóng\n- Pin chưa thật sự tốt\n- Phần mềm (firwmare) còn lỗi nhiều', ''),
(97, '', '', '', '', ''),
(98, '', '', 'Quay video độ phân giải cao, lấy nét tự động (AF) 11 điểm, với nhiều chế độ phù hợp với những điều kiện chụp khác nhau, sử dụng thẻ SD, chất lượng ảnh tốt, ', 'Độ nhạy sáng hạn chế; ISO thấp hơn Canon EOS 50D, lense kit bình thường, cổng HDMI có phần hạn chế', ''),
(99, '', '', '- Android 4.0 gần như nguyên bản\n- Màn hình LCD 720p\n- Kết nối AT&T LTE tốc độ cao', '- Pin không tháo ra được\n- Thiết kế không gây ấn tượng\n- Bộ nhớ chỉ có 8GB', ''),
(100, '', '', '- Giá thấp\n- Thời lượng pin tốt\n- Thiết kế đẹp', '- Màn hình chất lượng thấp\n- Ứng dụng có số lượng hạn chế\n- RAM 256MB gây ra nhiều giới hạn\n- Không thể quay phim 720p', ''),
(101, '', '', '- Chất lượng thiết kế chắc chắn.\n- Kích thước hoàn hảo để dùng bằng một tay.\n- Hoạt động mượt mà.', '- Nhiều phần mềm kèm theo cùng hoạt động.\n- Chất lượng máy ảnh bình thường.\n- Thiết kế không đột phá.', ''),
(102, '', '', '- Hiệu suất làm việc tốt\n- Thời lượng sử dụng thuyết phục\n- Chế độ nhận dạng chữ viết tay được cải thiện\n- Bút cảm ứng S Pen đi kèm thực sự hữu ích', '- Màn hình hiển thị chưa thực sự hoàn hảo\n- Các ứng dụng sử dụng bút cảm ứng còn ít\n- Chất liệu vỏ gây cảm giác rẻ tiền\n- S Planner hoạt động kém hiệu quả hơn ứng dụng Calendar mặc định', ''),
(103, '', '', '- Màn hình cảm ứng nhạy hơn\n- Giao diện Series 40 được làm mới\n- Kết nối 3G, Wi-Fi', '- Không đủ rẻ, những smartphone tốt hơn giờ có cùng mức giá\n- Thiết kế chủ yếu là nhựa\n- Series 40 vẫn còn hơi chậm', ''),
(104, '', '', '- Một chiếc smartphone 4.3 inch rất nhỏ gọn\n- Chất lượng cuộc gọi tốt', '- Chất lượng ảnh cần phải được cải tiến thêm\n- Giao diện tùy biến không được hoàn hả', ''),
(106, '', '', '+ Thiết kế chất lượng, giúp sử dụng thoải mái;\n+ Màn hình sắc nét;\n+ Khả năng mở rộng bộ nhớ lưu trữ;\n+ Có thể sử dụng như điều khiển đa năng cho rất nhiều thiết bị trong nhà.', '- Mở lại máy từ trạng thái nghỉ khá lâu;\n- Màn hình thỉnh thoảng bị chập chờn;\n- Giá đắt.', ''),
(107, '', '', '+ Thiết kế dễ cầm, bắt mắt\n+ Sử dụng màn hình cảm ứng điện dung\n+ Hỗ trợ Wi-Fi\n+ Cài sẵn nhiều ứng dụng và game', '- Màn hình nhỏ, độ phân giải thấp\n- Giá hơi đắt', ''),
(108, '', '', '+ Màn hình lớn, sắc nét, hiển thị màu chuẩn\n+ Tỷ lệ màn hình 4:3 phù hợp với lướt web và đọc sách điện tử\n+ Hiệu năng xử lý nhanh nhẹn\n+ Thiết kế mỏng, nhẹ\n+ Thời lượng pin ấn tượng', '- Thân máy to, khó sử dụng một tay\n- Camera tốc độ chụp chậm, hình ảnh bình thường\n- Không hỗ trợ khe cắm thẻ nhớ\n- Không có khe cài bút cảm ứng, bút ít chức năng hơn so với Galaxy Note', ''),
(110, '', '', '- Thiết kế hợp lí, thoải mải khi cầm\n- Nhẹ, chắc chắn\n- Thời lượng pin lâu\n', '- Không có đèn báo lượng pin còn lại', ''),
(111, '', '', 'Pin dung lượng lớn.\nNghe/gọi điện thoại tốt.\nTích hợp FM Radio.\nHệ điều hành 7.1 tích hợp mạng xã hội, lướt web ổn định', 'Camera chất lượng trung bình, không có tự động canh nét.\nKhông tích hợp 3G và GPS.\nKho ứng dụng nghèo nàn', ''),
(125, '', '', '+ Thiết kế đẹp, chắc chắn\n+ Hiệu năng mạnh mẽ\n+ Bộ nhớ trong lớn, 64 GB\n+ Hệ điều hành mới Android 4.1 Jelly Bean\n+ Camera tốc độ chụp ấn tượng\n+ Màn hình lớn sắc nét', '- Ít lựa chọn màu, chỉ có màu đen\n- RAM nhỏ hơn đối thủ cạnh tranh', ''),
(126, '', '', '+ Máy ảnh tuyệt vời, sánh ngang với máy ảnh compact\n+ Chụp tốt trong điều kiện thiếu sáng\n+ Màn hình dễ đọc ngoài trời\n+ Thiết kế chắc chắn\n+ Có khe cắm thẻ nhớ microSD để mở rộng bộ nhớ', '- Màn hình độ phân giải thấp\n- Cấu hình phần cứng thấp so với tầm giá của máy\n- Hệ điều hành Symbian lỗi thời\n- Thiết kế cồng kềnh', ''),
(127, '', '', '+ Hiệu năng thuyết phục\n+ Thời gian sử dụng pin tuyệt vời (khi đi kèm với PadFone Station và PadFone Station Dock)\n+ Thiết kế đẹp', '- Cồng kềnh\n- Việc gắn và tháo PadFone có thể hơi khó chịu\n- Touchpad lớn có thể ảnh hưởng tới bạn khi đang gõ phím\n- Giá đắt', ''),
(135, '', '', '+ Thiết kế đẹp, cao cấp\n+ Khả năng gọi điện và nhắn tin giống như điện thoại thông thường\n+ Máy ảnh 3MP chụp ảnh khá đẹp\n+ Thời gian pin tốt', '+ Màn hình bóng và khó nhìn ở môi trường sáng\n+ Hiệu năng không cao', ''),
(136, '', '', '+ Là một trong những laptop đầu tiên có màn hình cảm ứng kèm Windows 8 bản quyền\n+ Thiết kế đẹp, chắc chắn\n+ Màn hình cảm ứng và touchpad đều nhạy\n+ Giá hấp dẫn', '- Hơi dày, nặng hơn so với tiêu chuẩn Ultrabook\n- Thời lượng pin ở mức trung bình\n- Vỏ máy dễ bám bẩn, khó lau sạch', ''),
(137, '', '', '+ Giá hấp dẫn\n+ Hiệu năng khá\n+ Đủ các cổng thông dụng\n+ Máy hoạt động êm và mát mẻ\n+ Khả năng nâng cấp và vệ sinh dễ dàng', '- Màn hình sử dụng ngoài trời chưa tốt\n- Thời gian sạc pin lâu', ''),
(138, '', '', 'Đầu tư hơn về kịch bản\nDiễn xuất tốt\nQuy tụ dàn diễn viên nổi tiếng của nhiều châu lục', 'Kịch bản vẫn chưa mới và đột phá\nKỹ xảo 3D chưa thực sự hấp dẫn\n', ''),
(139, '', '', 'Đã đầu tư hơn vào kịch bản\nQuy tụ dàn diễn viên nổi tiếng với diễn xuất tốt\nCảnh quay đẹp\nHiệu ứng âm nhạc hấp dẫn', 'Hiệu ứng 3D chưa thực sự đạt hiệu quả tối đa\nKịch bản mặc dù có đầu tư nhưng chưa đột phá\n', ''),
(140, '', '', '+ Hấp dẫn, kịch tính\n+ Cảnh quay đẹp, hiệu ứng hoành tráng\n+ Âm thanh tuyệt hảo', '+ Mô típ anh hùng cũ\n+ Dàn diễn viên k quá nổi tiếng\n', ''),
(142, '', '', '+ Màn hình IPS chất lượng rất tốt\n+ Có thể biến hình rất linh hoạt\n+ Bàn phím tuyệt vời khi gõ\n+ Giá mềm một cách đáng ngạc nhiên\n+ Hiệu năng mạnh mẽ', '- Bàn phím không có đèn nền\n- Độ nhạy cảm ứng không ổn định\n- Thời lượng pin trung bình', ''),
(143, '', '', '+ Diễn xuất tốt.\n+ Hiệu ứng âm thanh tốt.\n', '+ Kịch bản có chiều hướng bớt hấp dẫn dần.\n+ Mô típ đã có trong nhiều bộ phim\n', ''),
(144, '', '', '+ Thiết kế chắc chắn, khả năng chống chịu va đập tốt\n+ Vỏ và thân bằng chất liệu kim loại sang trọng và sạch sẽ\n+ Tản nhiệt tốt\n+ Thời lượng pin tốt\n+ Hiệu suất khá', '- Kiểu dáng giống đời cũ, dày\n- Diện tích touchpad nhỏ', ''),
(145, '', '', '+ Ultrabook giá hấp dẫn\n+ Cấu hình khá, tích hợp ổ đĩa quang, card đồ họa rời\n+ Tản nhiệt tốt\n+ Ổ lưu trữ lớn kết hợp với ổ Cache tốc độ cao', '- Bàn phím chưa thật tốt\n- Vỏ dính vân tay và khó lau sạch\n- Thời gian sạc pin lâu', ''),
(146, '', '', '+ Tình tiết hấp dẫn sáng tạo\n+ Diễn xuất cực tốt \n+ Ngoài tiếng cười còn truyền trải nhiều thông điệp ý nghĩa trong cuộc sống', '+ Kéo dài qua nhiều season ( hiện tại đã tới season 8)\n', ''),
(147, '', '', '+ Windows 7 bản quyền\n+ Thiết kế chắc chắn\n+ Hiệu năng tốt\n+ Khả năng giải trí đa phương tiện tốt\n+ Màn hình góc nhìn rộng', '- Khu vực lòng bàn tay hơi nóng khi dùng lâu\n- Thời lượng pin hơi thấp so với kỳ vọng', ''),
(148, '', '', '+ Thiết kế mỏng và nhẹ\n+ Tốc độ xử lý và đáp ứng cao\n+ Touchpad chất lượng tốt.', '- Độ phân giải màn hình thấp, góc nhìn hẹp\n- Thiết kế không đặc sắc, khá giống MacBook Air.', ''),
(149, '', '', '+ Kết hợp thành công các yếu tố hài hước, lãng mạn, cảm động . Truyền tải được nhiều thông điệp ý nghĩa. Kịch bản dựa trên một câu chuyện có thật\n+ Diễn xuất tốt\n+ Hiệu ứng âm thanh tuyệt vời cho một bộ phim âm nhạc ', '+ Kịch bản chưa nhiều đột phá. Motip giống nhiều bộ phim đã từng trình chiếu của Nhật như My boss, my hero, Hitman..v...v..', ''),
(150, '', '', '+ Giá hấp dẫn\n+ Tích hợp nhiều tiện ích tốt\n+ Công nghệ Rapid Wake + Eco\n+ Hỗ trợ đầy đủ cổng giao tiếp\n+ Âm thanh khá', '- Thời lượng pin chưa thực sự hấp dẫn\n- Thời gian sạc pin lâu\n- Thiết kế hơi dày so với nhiều ultrabook khác', ''),
(151, '', '', '+ Hiệu suất tuyệt vời\n+ Âm thanh hoàn hảo\n+ Rất nhiều cổng kết nối', '- Ồn\n- Nặng\n- Đắt tiền\n- Khá nóng', ''),
(152, '', '', '+ Kịch bản xuất sắc, mô tả được hiện thực xã hội đương đại Mỹ với nhiều góc khuất.\n+ Dàn diễn viên chính với diễn xuất tuyệt vời.', '- Hình ảnh chứa nhiều cảnh liên quan bạo lực, tình dục,ma túy\n- Nội dung phim không hợp với trẻ em hoặc những người có tâm hồn lãng mạn, mong manh dễ vỡ.', ''),
(153, '', '', '+ Thiết kế nhỏ gọn và mỏng, nhẹ, hiệu suất cao\n+ Giá cả cạnh tranh.', '- Các cổng kết nối ở phía sau gây bất tiện cho người dùng\n- Màn hình gương có góc nhìn khá hạn chế\n- Bàn phím không có đèn nền\n- Tuổi thọ pin thấp', ''),
(155, '', '', '+ Góc quay và hiệu ứng tuyệt vời - chưa chắc các siêu phẩm đã có thể sánh bằng\n+ Âm thanh chuẩn, lôi cuốn. Kéo người xem vào guồng câu chuyện trong phim.\n+ Diễn xuất tốt', '- Cốt truyện không mới.\n- Kết thúc chưa hoàn hảo', ''),
(156, '', '', '+ Cảnh quay hoành tráng với những màn đua xe ngoạn mục, gán mác chỉ có ở series FF\n+ Âm thanh lôi cuốn, phù hợp với tình tiết của film\n+ Nội dung logic và hồi hộp hấp dẫn nhất trong tất cả các phần ', '- Nút thắt về cái chết của người vợ Dom Toretto hé lộ khiến người xem chắc chắn lại phải ...mất tiền xem phần 6 ( không biết là ưu hay nhược điểm ).\n', ''),
(157, '', '', '+ Hiệu suất đáng ngạc nhiên\n+ Màn hình 17.3inch full HD hiển thị cực đẹp\n+ Hệ thống âm thanh mạnh mẽ\n+ Nút điều chỉnh giúp thay đổi các kiểu thiết lập năng lượng tiện dụng.', '- Máy khá nóng khi vận hành\n- Quạt tản nhiệt kêu khá to\n- Webcam không nét.', ''),
(158, '', '', '- Bộ xử lý Intel thế hệ 3 - Ivy Bridge\n- Hiệu năng tốt\n- Vòng đời pin lâu\n- Âm thanh và giải trí tốt\n- Tản nhiệt tốt\n- Bàn phím tốt\n- Nhiều cổng kết nối', '- Thiết kế dày\n- Touchpad sử dụng chưa thuận tiện', ''),
(159, '', '', '+ Kịch bản chặt chẽ thú vị. Mang nhiều chi tiết thực tế của lịch sử\n+ Dàn diễn viên gạo cội với diễn xuất tuyệt vời\n+ Hình ảnh, góc máy và âm thanh hoàn hảo.', '- Mạch phim hơi chậm, không thích hợp với những người sôi nổi, thích phim hành động hoặc hài hước\n- Hàm lượng nghệ thuật cao. Màu sắc u ám, tinh tế.', ''),
(160, '', '', '+ Vì là một bộ phim âm nhạc nên âm thanh cực kỳ xuất sắc\n+ Kịch bản dựa trên cuộc đời có thật của một nữ danh ca. Triết lý và ý nghĩa rút ra cực sâu sắc\n', '- Mạch phim hơi rối khi không diễn tả tuần tự cuộc đời của nữ danh ca . Bắt buộc người xem phải tập trung chú ý theo dõi và ghi nhớ chi tiết ', ''),
(161, '', '', '+ Thiết kế đẹp giống Macbook\n+ Giá phải chăng so với các ultrabook khác\n+ Thân máy mỏng nhưng có nhiều cổng kết nối', '- Bàn phím bị flex, không có đèn nền\n- Touchpad không được tốt\n- Góc nhìn màn hình hẹp\n- Pin có thể tốt hơn', ''),
(162, '', '', '+ Giá hấp dẫn\n+ Nhiều tùy chọn màu sắc\n+ Hiệu năng ở mức khá so với giá cả\n+ Bàn phím hỗ trợ phím nóng', '- Touchpad hơi nhỏ\n- Phím điều hướng nhỏ\n- Loa âm lượng nhỏ', ''),
(163, '', '', '+ Thiết kế chắc khỏe\n+ Giá mềm so với hiệu năng\n+ Bàn phím gõ êm tay\n+ Công nghệ Sleep n Charge sạc pin thiết bị di động không cần bật máy\n+ Công nghệ Resolution+ cải thiện chất lượng hình ảnh khi xem phim DVD', '- Tốc độ đọc ghi ổ cứng chậm\n- Touchpad hơi trơn và dễ di ra ngoài', ''),
(164, '', '', '', '', ''),
(165, '', '', '', '', ''),
(166, '', '', '+ Thiết kế đẹp, mỏng và nhẹ\n+ Màn hình sắc nét, độ phân giải cao, góc nhìn tốt\n+ Mỏng nhưng đầy đủ kết nối\n+ Loa tốt\n+ Bàn phím backlit, độ nảy tốt, touchpad rộng, đáp ứng chính xác', '- Thời lượng pin trung bình\n- Giá cao', ''),
(167, '', '', '+ Kết cấu bền, chắc chắn\n+ Có thể thay đổi vỏ máy\n+ Màn hình sáng, góc nhìn tốt\n+ Hiệu năng khá\n+ Dung lượng RAM lớn\n+ Ổ cứng tốc độ 7200RPM', '- Touchpad kích thước nhỏ\n- Giá cao so với nhiều laptop cùng cấu hình\n- Bàn phím gõ không êm tay', ''),
(168, '', '', '+ Tích hợp USB 3.0 và HDMI\n+ Win 7 bản quyền\n+ Thời lượng pin tốt\n+ Màn hình độ phân giải tốt, xem HD tốt', '- Giá tương đối cao so với dòng netbook\n- Chuột trên touchpad nặng', ''),
(169, '', '', '+ Giá mềm so với hiệu năng\n+ Hỗ trợ tính năng họp hội nghị tốt\n+ Bàn phím và touchpad hoạt động tốt\n+ Hỗ trợ đầy đủ các cổng kết nối thông dụng\n+ Thời lượng pin khá', '- Thiết kế chưa thực sự ấn tượng\n- Hơi dày và nặng\n- Loa nghe hơi nhỏ (mặc dù âm thanh hay)', ''),
(170, '', '', '', '', ''),
(171, '', '', '', '', ''),
(172, '', '', '', '', ''),
(174, '', '', '+ Hiệu suất tuyệt vời\n+ Màn hình rất sáng với màu sắc tốt\n+ Âm thanh đáng kinh ngạc cả về âm lượng và chất lượng\n+ Có rất nhiều kết nối (HDMI, 4 USB)\n+ Có một card đồ họa rất tốt\n+ Thiết kế bền đẹp', '- Màn hình chói, lóa, bóng khi ở ngoài trời\n- Vỏ khá bám vân tay\n- Touchpad không nhạy lắm\n- Tuổi thọ pin không dài\n- Khá nóng máy khi chạy', ''),
(175, '', '', '+ Thiết kế hiện đại, kiểu dáng mỏng nhẹ ấn tượng\n+ Tản nhiệt tốt so với một mẫu máy mỏng nhẹ\n+ Tích hợp âm thanh tốt\n+ TouchPad nhạy, hỗ trợ đa điểm tốt\n+ Thời gian chờ lên đến Hai tuần\n+ Instant On chỉ mất 2 giây', '-­ Bàn phím không có đèn nền\n- Giá cả chưa hấp dẫn', ''),
(176, '', '', '', '', ''),
(177, '', '', '+ Thiết kế bền bỉ, lịch lãm\n+ Tuổi thọ pin dài\n+ Âm thanh tốt', '- Thiếu kết nối hiện đại\n- Tính năng chưa nổi bật\n- Góc nhìn hẹp', ''),
(178, '', '', '50 sắc thái có thể nổi tiếng nhờ vào những tranh cãi ngoài lề tác phẩm nhưng đây thực sự là một câu chuyện thu hút với những tình tiết mô tả đầy chân thực về cuộc sống tình dục của một đôi tình nhân trẻ. Độc giả sẽ được tham gia vào một hành trình khám phá tâm hồn đầy đau khổ của các nhân vật thông qua lối hành văn có thể sẽ khiến nhiều độc giả cảm thấy sốc thực sự nhưng lại chạm tới được những ngóc ngách sâu thẳm nhất, khao khát nhất mà con người thường đau khổ che đậy. Chính sự dũng cảm đó đã mang đến thành công cho bộ sách và triệu triệu phụ nữ trên khắp thế giới truyền tay nhau, coi chúng như “một liều thuốc kỳ diệu cho những cuộc hôn nhân bên bờ băng giá”???', 'Nguồn gốc cuốn sách được bắt đầu như một fan fiction của bộ truyện Chạng Vạng nổi tiếng khiến cho 50 Sắc Thái nhận được khá nhiều lời phê bình khen chê. Giọng văn đơn giản với nhiều ngôn ngữ lóng trên mạng, câu từ không được trau chuốt nhiều và nghệ thuật viết truyện không có gì đặc sắc. Điểm nổi bật là các nội dung liên quan đến BDSM và sex thì lại được cho rằng sẽ tạo ra một trào lưu đáng xấu hổ trong thế kỷ hiện đại, nơi phụ nữ đã có được sự bình quyền nam nữ. Do đặc thù cốt truyện và bối cảnh xã hội khiến cho cuốn sách khó được chấp nhận ở một số nền văn hóa riêng biệt. Sự thành công trên toàn cầu của bộ truyện khiến cho rất nhiều độc giả và nhà phê bình văn học vấn nghi về tương lai của những trang sách khi mà yếu tố thị trường bắt đầu lấn lướt nghệ thuật văn chương thực thụ.', ''),
(179, '', '', '+ Thiết kế mỏng, nhẹ, tính di động cao\n+ Bề mặt vỏ và màn hình chống xước\n+ Cấu hình đáp ứng tốt nhu cầu công việc thông thường\n+ Công nghệ Power Plus giúp tăng tuổi thọ pin', '- Màn hình không sắc nét\n- Phím bốn chiều nhỏ, bất tiện\n- Không có ổ đĩa quang', ''),
(180, '', '', '+ Cảnh quay đẹp, hiệu ứng 3D tuyệt hảo\n+ Diễn xuất cá tính cùng âm thoại rất đặc biệt của Benedict Cumberbatch', '- Mạch phim có phần giảm cao trào về cuối, chưa thỏa mãn được người xem \n- Cắt mất một số tình tiết \" chỉ fan mới hiểu \".', ''),
(181, '', '', '+ Nhiều màu sắc để lựa chọn\n+ Chất lượng âm thanh tốt\n+ Tản nhiệt tốt\n+ Giá phù hợp so với cấu hình', '- Vỏ và màn hình dễ bắt vân tay, dễ bám bụi bẩn\n- Thiết kế dày và nặng\n- Các cổng kết nối không thuận tiện\n- Màn hình gương bóng, góc nhìn hẹp', ''),
(182, '', '', '+ Độ bền tuyệt vời\n+ Tuổi thọ pin tốt\n+ Khởi động nhanh', '- Đắt tiền\n- Nặng nề\n- Có sự cố với khả năng chống tràn của bàn phím', ''),
(183, '', '', '', '', ''),
(184, '', '', '+ Hiệu năng tốt hơn model 2010\n+ Bàn phím có đèn nền\n+ Thiết kế ấn tượng\n+ Độ phân giải màn hình siêu cấp\n+ Touchpad rất nhạy\n+ Thời gian khởi động lại từ chế độ Sleep nhanh\n+ Có trang bị cổng Thunderbolt', '- Đắt\n- Tuổi thọ pin không dài', ''),
(185, '', '', '+ Thiết kế tốt, khung máy chắc chắn\n+ Bàn phím có thiết kế tốt, sử dụng thoải mái\n+ Màn hình có công nghệ chống xước tốt\n+ Pin có khả năng sạc nhanh 80% trong 30 phút', '- Thiếu ổ quang\n- Không có card đồ họa rời\n- Giá cao', ''),
(186, '', '', '+ Thiết kế tốt, bền chắc\n+ Cấu hình cao, hiệu năng tốt', '- Nặng, cồng kềnh khi di chuyển\n- Màn hình chưa đạt độ phân giải full HD', ''),
(187, '', '', '+ Thiết kế kim loại đẹp.\n+ Giá phải chăng.\n+ Ổ cứng lớn 750GB.\n+ Bộ vi xử lý Core i5 và 8GB là một kết hợp mạnh mẽ, ít thấy trên các model laptop khác.\n+ Hỗ trợ WiDi 2.0 và WiMAX.\n+ USB 3.0 port.\n+ Thời lượng pin tốt.', '- Không có chip đồ họa rời', ''),
(188, '', '', '', '', ''),
(189, '', '', '', '', ''),
(191, '', '', '- Thiết kế đẹp \n- Màn hình lớn độ phân giải HD \n- Pin xài lâu', '- Giá cao \n- Bộ nhớ trong ít \n- Máy nặng', ''),
(192, '', '', '+ Thiết kế bàn phím trượt độc đáo\n+ Màn hình IPS chất lượng hiển thị tốt và góc nhìn rộng\n+ Có bàn phím vật lý để dùng như netbook\n+ Hỗ trợ đầy đủ các cổng kết nối thông dụng\n+ Loa ngoài chất lượng cao', '- Máy cồng kềnh và nặng nề\n- Không thể tháo rời bàn phím và màn hình\n- Viền màn hình quá to tạo cảm giác thô kệch\n- Cảm biến ánh sáng hoạt động kém hiệu quả\n- Thời lượng pin thấp\n- Xem phim Full HD 1080p bị giật hình', ''),
(193, '', '', '+ Màn hình ấn tượng nhất trong số tablet 7 inch\n+ Âm thanh mượt mà\n+ Giao diện tinh tế, dễ dàng truy cập vào các nội dung Amazon\n+ Hiệu năng/giá hấp dẫn', '- Đôi lúc tốc độ xử lý chậm chạp\n- Khó cầm hơn Google Nexus 7\n- Một số ứng dụng và game chưa có trên kho ứng dụng\n- Phải trả thêm 15 USD để mua bản không kèm quảng cáo', ''),
(195, '', '', '+ Hiệu năng cao\n+ Màn hình có góc nhìn rộng\n+ Bán kèm bàn phím\n+ Có cổng HDMI và khe cắm thẻ nhớ microSD', '- Gắn máy tính bảng vào đế khó\n- Webcam có vị trí không phù hợp\n- Âm thanh nhỏ\n- Bàn phím quá nhỏ', ''),
(196, '', '', '+ Bộ vi xử lý 4 nhân\n+ Camera mặt trước có nhiều tính năng chụp ảnh, quay phim.\n+ Hệ điều hành Android 4.0 được cài sẵn', '- Màn hình quá lớn nên hơi cồng kềnh khi sử dụng\n- Màn hình không có tỷ lệ 16:9 để phù hợp với xem phim', ''),
(197, '', '', 'Samsung Note 8.0 có ưu điểm là rất dễ cầm, thiết kế tương đối đẹp so với dòng máy tính bảng loại nhỏ. Bút S pen của samsung galaxy note 8 cho người dùng cảm giác tự nhiên khi viết trên màn hình. Ngoài ra với thẻ nhớ ngoài, người dùng có thể tự mở rộng bộ nhớ cho máy.', '- Giá bán của samsung note 8.0 trên thị trường quốc tế là 399$ là một giá tương đói cao cho dòng mini table nói chung, không những thế ở việt nam nói riêng 1 chiếc samsung note 8.0 có giá bán sấp xỉ lên tận 11 triệu. \n- Dày hơn Ipad mini\n- Cũng như bất cứ ai dùng máy của Samsung, 2 nút cảm ứng cạnh nút home nhiều lúc gây khó chịu cho người dùng khi chẳng may chạm phải', ''),
(198, '', '', '+ Màn hình sắc nét, tương phản tốt và góc nhìn rộng\n+ Tốc độ xử lý nhanh\n+ Máy mỏng, nhẹ và cầm bám tay\n+ Thời lượng pin tốt\n+ Hỗ trợ 3G', '- Thiếu khe cắm thẻ nhớ ngoài, HDMI\n- Vỏ nhựa tạo cảm giác không chắc chắn\n- Không sạc pin qua cáp USB nối với PC\n- Sử dụng đầu giắc cắm riêng của Samsung\n- Màn hình cảm ứng không nhạy như iPad 2', ''),
(199, '', '', '+ Tốc độ xử lý khá mạnh so với tầm giá\n+ Bộ nhớ trong lớn hơn Kindle Fire và có khe cắm microSD\n+ Tích hợp nhiều nội dung trả phí hấp dẫn\n+ Thời lượng pin tốt', '- Không hỗ trợ Android Market\n- Không có kính chống xước Gorilla\n- Không có 3G, máy ảnh, GPS, Bluetooth\n- Bộ nhớ trong lớn nhưng chỉ có 1 GB dành cho người dùng\n-Không hỗ trợ sạc pin qua cổng MicroUSB', ''),
(200, '', '', '+ Rất mỏng, chỉ có 7,7mm và cũng rất nhẹ', 'Không có nhiều điểm nổi trội so với các máy tính bảng Android khác.', ''),
(203, '', '', 'BlackBerry PlayBook là máy tính bảng 7 inch mạnh và nhanh, có cổng HDMI, trình duyệt tích hợp Adobe Flash 10.2 mang lại trải nghiệm web như trên máy tính để bàn.', 'Màn hình 7 inch làm tù túng trình duyệt mạnh mẽ, nút nguồn sâu khó bấm và một số tính năng quan trọng chỉ có sau khi kết nối với điện thoại BlackBerry.', ''),
(204, '', '', '+ Mỏng như iPad 2 và thậm chí mỏng hơn\n+ Là máy tính bảng Honeycomb có thiết kế đẹp\n+ Có máy ảnh 3 megapixel mặt sau và máy ảnh mặt trước 2 megapixel\n+ Cặp loa kép mạnh mẽ', '- Thiếu một số cổng kết nối (HDMI, USB, microSD)\n- Vỏ nhựa phía sau tạo cảm giác không chắc chắn như iPad 2.', ''),
(205, '', '', '', '', ''),
(209, '', '', '', '', ''),
(210, '', '', '+ Góc quay đỉnh cao với những hình ảnh tuyệt vời của dàn siêu xe ấn tượng. Âm thanh và hiệu ứng phối hợp hoàn hảo cùng hình ảnh.\n+ Nhịp phim nhanh, dồn dập.\n', '- Không có. Nếu có thì chắc buồn nhất là lại phải vật vã chờ đợi phần 7 ( chắc chắn có )', ''),
