(243, '', '', '- Chạy hệ điều hành Android nhiều tính năng phụ trợ\n- Có kết nối 3G tiện lợi\n- Màn hình cảm ứng lớn, hiển thị đẹp, cảm ứng nhạy\n- 16 mega pixels  ', '- Nếu thật sự muốn có một bức ảnh với chất lượng cao, thì Samsung Galaxy Camera chưa đáp ứng được.\n- Màu trắng dễ bám bẩn\n- Thời lượng pin ngắn\n- Và cuối cùng nếu muốn dùng chức năng 3G của máy, bạn sẽ phải nạp tiền hàng tháng. ', ''),
(244, '', '', '- Chất lượng ảnh tốt\n- Thiết kế màn hình xoay thuận tiện cho việc chụp ảnh', '- Ống kính của G1 X tương đối tồi so với giá thành chúng ta bỏ ra để mua máy\n- Tốc độ chụp ảnh của máy chậm.\n ', ''),
