(303, '', '', 'Thiết kế độc đáo\nNhiều hiệu ứng chụp hình và chất lượng hình tốt.\nCó kết nối Wi-Fi dễ dàng chia sẽ hình ảnh', 'Màn hình không lật được 180 độ khó tự chụp chân dung.\nNgười dùng lần đầu sẽ khó sử dụng máy do cách chup lạ.', ''),
