(310, '', '', 'The Samsung Galaxy S4 chạy Android 4.2.2, một camera tuyệt vời, một bộ xửa lý quad-core mạnh mẽ, và giải pháp phần mềm cho tất cả mọi mục đích -- bao gồm làm việc như là một chiếc remot TV/DVR. Nó cũng rất thuận tiện trong tay bạn với NFC, pin rời có thể thay thế, và khe cắm SD card', 'Màn hình tối hơn các điện thoại siêu phẩm khác. Thiết kế nhựa khiến cho S4 nhìn rẻ tiền hơn giá trị thật của nó, và chúng tôi thấy nút nguồn của Galaxy S4 tự bật một số lần. Không phải tất cả các mode của camera hoạt động như giới thiệu, và quá phần mềm đi kèm khiến người sử dụng bối rối (và gây nặng máy)', ''),
(311, '', '', '', '', ''),
(312, '', '', 'Chỗ ngồi thoải mái.\nThích ăn mấy món nóng sốt như vầy.\nBò mềm và ngon.', '-Mấy món ăn đính kèm trong Combo dở không chịu nổi, ngoại trừ khoai tây nghiền.\n-Tốt nhất là ăn món Bò thôi, vì lúc đầu khi thằng này ra mình thấy chỉ có món bò. Món gà ăn chán ơi là chán, cá thì chưa thử qua.', ''),
(313, '', '', '', '', ''),
(315, '', '', '', '', ''),
(316, '', '', '', '', ''),
(317, '', '', 'Thiết kế thời trang, phù hợp với giới trẻ\nChất lượng phần cứng tốt, độ bền cao\nÂm thanh thể hiện tốt với nhạc pop, hiphop, nhạc điện tử', 'Vỏ bóng nên dễ bị bẩn và bị xước\nÂm thanh không phù hợp với nhạc Acoustic, Jazz hay Concert\nĐộ chi tiết của âm thanh và khả năng thể hiện không gian kém.', ''),
(318, '', '', '', '', ''),
(319, '', '', '', '', ''),
(320, '', '', '', '', ''),
(321, '', '', 'quán này bán tokbokki truyền thống và hải sản ngon, giá cũng rất sinh viên. Chủ quán là người Hàn luôn nên không phải băn khoăn về hương vị món ăn nhé. Bạn sẽ thấy ông chủ là 1 người rất dễ thương và nhiệt tình, lúc nào cũng cười. Nếu mà bạn có bị làm phiền thi ông chủ sẽ ra nhắc giúp bạn nữa đó. Ngoài topbokki quán còn nhiều món ăn nhẹ khác.\nNước uống free nhé, bạn sẽ được phục vụ nước lọc lạnh ngay khi vào quán, và khi thanh toán hóa đơn, bạn sẽ được nhận một chén trà quế thơm nức (đó đúng là 1 cái chén kiểu, rất rộng và xinh, không phải 1 cái ly bình thường đâu, một nét rất riêng của quán).\nNgoài ra, quán được trang trí theo phong cách của Hàn Quốc với giấy dán tương nên không khí rất ấm cúng. Có 2 lựa chọn chỗ ngồi là ngồi ghế và ngồi trên nền, cái nào cung thoải mái cả.', 'Quán khá nhỏ nên những giờ tan tầm thường rất đông khách, dĩ nhiên sẽ làm không kịp và phục vụ sẽ chậm rồi. Đôi khi có vài người bán rong hay vé số sẽ mời chào bạn nếu bạn ngồi gần cửa, đó không phải do quán nhưng cũng hơi phiền phải không nào.', ''),
