(366, '', '', 'Cốt truyện thông minh, nhân vật mới ấn tượng\nCách chơi đa dạng hơn\nNhịp độ game nhanh\nChứa đựng những tình tiết ”sốc tới óc”', 'Một số lỗi kĩ thuật\nQuá ngắn và làm người ta nôn nóng đợi Season 2', ''),
(367, '', '', 'Đồ họa, âm thanh ấn tượng\nLối chơi nhanh, dồn dập, chặt chém đã tay\nNhiều bí mật để khám phá', 'Cốt truyện hời hợt\nĐòn thế lặp lại\nGiá trị chơi lại thấp', ''),
