(369, '', '', 'Đồ ăn ngon\nNước mía cũng ngon\nGiá tốt', 'Hơi xa trung tâm', ''),
(370, '', '', 'Không gian ấn tượng, độc đáo\nVị trí thuận lợi', 'Đồ ăn không được ngon lắm', ''),
(382, '', '', '', '', ''),
(372, '', '', '', '', ''),
(373, '', '', '+ Nội dung khá hấp dẫn\n+ Diễn xuất tốt\n', '- Mạch phim hơi dài\n', ''),
(374, '', '', '+ Dàn diễn viên với diễn xuất tốt, ngoại hình đẹp\n+ Nội dung khắc họa 1 phần lịch sử miền viễn Tây nước Mỹ', '- Chưa phong phú lắm trong nội dung\n- Hình ảnh trung bình', ''),
(384, '', '', '', '', ''),
(383, '', '', '', '', ''),
(377, '', '', 'Tiện, hỗ trợ nhiều game của Gameloft', 'Các game của hãng khác chưa được hỗ trợ nhiều\nKhó kiếm ở Việt Nam', ''),
(378, '', '', '', '', ''),
(379, '', '', 'Gameplay độc đáo và thú vị, vũ khí, các loại bẫy và vật dụng cổ điển đậm chất Bắc Mỹ.', 'Các đòn cận chiến đơn điệu, đồ họa không xuất sắc.', ''),
(380, '', '', 'Cực kì vui nhộn\nDiễn viên diễn rất tốt', '', ''),
(381, '', '', '', '', ''),
(385, '', '', '- Game cuốn hút người chơi nhờ những chi tiết nhỏ nhặt\n- Đồ họa khá so với mặt bằng chung (webgame)', '- Các lớp nhân vật không có sự phân hóa rõ rệt\n- Phần âm thanh chưa đủ hấp dẫn', ''),
(386, '', '', '', '', ''),
(387, '', '', '+ Hình ảnh đẹp, \n+ Âm nhạc hấp dẫn\n+ Lồng tiếng xuất sắc.', '- Cốt truyện mô típ cũ - nhưng ý nghĩa.', ''),
(388, '', '', '', '', ''),
(389, '', '', '+ Diễn xuất tuyệt vời \n+ Bối cảnh đẹp \n+ Cốt truyện nhẹ nhàng hấp dẫn.', '- Đối thoại quá nhiều \n- Cốt truyện đôi chỗ bất hợp lý.', ''),
(390, '', '', 'Diễn viên diễn quá xuất sắc', 'Không có', ''),
(391, '', '', 'Gameplay đơn giản, kết hợp nhiều thể loại run\nĐồ họa siêu dễ thương, giao diện bắt mắt, hiện đại\nÂm thanh vui nhộn', 'Gameplay vẫn là clone, chưa đột phá', ''),
(392, '', '', 'Đồ họa đẹp, pha trộn giữa cổ điển và hiện đại\nÂm thanh tuyệt vời\nTính thử thách cao\nGiá trị chơi lại cao\nClass đa dạng, nhân vật vui nhộn', 'Chỉ có 1 file save duy nhất\nCác class chưa cân bằng\nĐộ khó cao dễ làm nản lòng các game thủ thiếu kiên nhẫn\nVũ khí chưa thực sự đa dạng', ''),
(393, '', '', '', '', ''),
(394, '', '', '- Đồ họa đẹp, giao diện dễ nhìn, tối ưu cho màn hình cảm ứng smartphone\n- Tính năng vô cùng đa dạng, cách chơi thú vị\n- Hỗ trợ tân thủ tốt, quà tặng nhiều, hướng dẫn chi tiết', '- Tuy quảng cáo cho iOS và Android nhưng hiện mới chỉ có bản Jaibreak cho iOS, chưa có bản App Store và Android.\n- Server đông nên đôi khi bị văng khỏi game\n- Hơi khó chơi với những ai chưa từng chơi game chiến thuật', ''),
(395, '', '', '', '', ''),
(396, '', '', 'Hành động đẹp mắt, cốt truyện nhẹ nhàng, lôi cuốn ', 'Một vài tình huống truyện mang tính gượng ép, việc đan xen quá khứ hiện tại đôi chỗ gây khó hiểu cho người xem.', ''),
(397, '', '', '- Giá hợp lý\n-  Tích hợp công nghệ âm thanh Dirac HD, loa Stereo, xử lý nhạc Lossless\n-  Hệ điều hành Android 4.2 \n- Màn hình hiển thị màu sắc tốt \n- Hỗ trợ 2 SIM cùng chạy 3G', '- Độ phân giải màn hình thấp \n- Chất lượng ảnh chụp từ camera 5 megapixel trung bình', ''),
(398, '', '', '- Hỗ trợ 2 sim, 1 sim có thể tháo nóng không cần tắt máy tháo pin\n- Màn hình kích thước lớn\n- Bốn nhân, hỗ trợ thẻ nhớ gắn ngoài\n- Máy chạy không nóng', '- 1 sim bị ngắt khi sim kia đang thực hiện cuộc gọi\n- Tốc độ không cao\n- Màn hình chất lượng không cao\n- Chất lượng ảnh chụp tạm ổn, dùng được.', ''),
(399, '', '', '+ Cốt truyện đơn giản nhưng lôi cuốn, \n+ Các pha đấu súng đầy căng thẳng, kịch tính.\n\n', '- Kịch bản không có nhiều đất cho diễn xuất.', ''),
(400, '', '', '\n+ Góc quay đẹp \n+ Các pha rượt đuổi đầy hấp dẫn\n\n', '- Cốt truyện đơn giản \n- Âm nhạc kém nổi bật', ''),
(401, '', '', '+ Nội dung hài hước \n+ Hình ảnh đẹp mắt \n+ Âm nhạc vui nhộn\n\n', '- Những giá trị nhân văn thể hiện quá rõ ràng phần nào làm giảm đi tính ý nghĩa', ''),
(402, '', '', 'Chiếc máy quay Mini giá rẻ với các tính năng hợp lý trong phân khúc giá này, chịu nước trong độ sâu tới hơn 3m,có cáp HDMI,  phầm mềm chia sẻ tiện dụng', 'Không có built-in USB connecter, vòng đời pin kém trong điều kiện high resolution, không có thẻ nhớ, phần mềm chia sẻ giới hạn chỉ Windows', ''),
(403, '', '', 'Giá rất tốt\nThiết kế đẹp\nMàn hình lớn, khá sắc nét', 'Pin chưa tốt\nThương hiệu còn mới', ''),
(404, '', '', 'Chất lượng video tuyệt vời đối với các sản phẩm cùng tầm giá.\nChống nước 10m\nĐi kèm cáp HDMI\nPhần mềm chia sẻ tốt\nKhông có flash hoặc đèn video.\nPhim không gỡ được', 'Không có cổng USB built-in \nThời lượng pin thấp đối với độ phân giải cao nhất\nKhông có memory card\nPhần mềm chia sẻ chỉ có bản Windows', 'http://reviews.cnet.com/digital-camcorders/kodak-playsport-zx5-black/4505-6500_7-34531547.html');
INSERT INTO `rate_jreviews_review_fields` (`reviewid`, `jr_location`, `jr_agegroup`, `jr_pros`, `jr_cons`, `jr_readfullreview`) VALUES
(405, '', '', 'Hài, nhiều pha hành động đẹp mắt\nWen Zhang diễn xuất tốt và hài hước', 'Cốt truyện quá đơn giản và gượng ép\nCG và hiệu ứng quá xấu, chỉ có thể hơn phim biết chết liền\nVai diễn Jet Li không hợp, anh ấy không nên đóng hài', ''),
(406, '', '', '- Màn hình hiển thị hình ảnh đẹp, sắc nét\n- Kiểu dáng thiết kế bắt mắt.\n- Giá cả hợp lý.', '- Bộ nhớ RAM quá ít, đôi khi bị treo máy vì chạy ứng dụng nặng.\n- Bộ nhớ trong khá khiêm tốn, đối với người dùng thích vọoc điện thoại thì có vẻ hơi ít.\n- Không phù hợp đối với người dùng thích chơi nhiều game trên điện thoại.', ''),
(407, '', '', '+ Hình ảnh tốt \n+ Cốt truyện châm biếm dí dỏm, thông minh', '- Không có nhiều thông được ý nghĩa được gửi gắm với một bộ phim dành cho trẻ em', ''),
(408, '', '', 'Hugh Jackman diễn xuất quá hay. Tao Okamoto đẹp và mang đậm chất châu Á\nCốt truyện có nhiều bất ngờ vào khúc cuối\nNhiều pha hành động đỉnh cao\nBối cảnh ở Nhật, tạo cảm giác mới lạ và đẹp mắt.', 'Chưa có nhiều kịch tính trong cốt truyện, vẫn theo mô tuýp giải cứu người đẹp\nCảnh nóng bị cắt hết ở VN!\nChiến đấu với người thường là chủ yếu nên không có nhiều pha hoành tráng.\nHiệu ứng 3D chưa được đầu tư kỹ', ''),
(409, '', '', '+ Bối cảnh xuất sắc,\n+ Nội dung hài hước nhưng chứa đựng nhiều ý nghĩa.\n', '- Một vài lỗi nhỏ về khung cảnh', ''),
(410, '', '', '+ Diễn xuất tuyệt vời\n+ Lời thoại xuất sắc\n+ Bối cảnh London đẹp\n+ Ekip làm phim tên tuổi\n\n', '- Kịch bản hơi cường điệu hóa tính cách các nhân vật\n- Nhạc phim không có gì nổi bật', ''),
(411, '', '', '+ Cốt truyện mới lạ\n+ Thế giới tương lai được xây dựng ấn tượng\n\n\n', '- Thiếu điểm nhấn cần thiết\n- Các tình huống gay cấn chưa đủ độ chín', ''),
(412, '', '', '+ Dàn diễn viên đẹp\n+ Diễn xuất thú vị\n+ Kịch bản hài hước\n\n', '- Lời thoại đôi chỗ nhảm nhí\n- Nhiều tình tiết phi logic', ''),
(413, '', '', '+ Âm nhạc xuất sắc\n+ Cốt truyện kịch tính\n+ Góc quay thú vị\n', '- Kịch bản đôi chỗ hơi gượng ép\n- Nhân vật phản diện quá mờ nhạt', ''),
(414, '', '', '+ Thế giới “The Grid” được xây dựng ấn tượng\n+ Âm thanh tuyệt vời\n+ Hiệu ứng đẹp mắt\n+ Lời thoại súc tích\n\n\n', '- Cốt truyện chưa sâu sắc\n- Kịch tính phim thiểu điểm nhấn cần thiết', ''),
(415, '', '', '+ Dàn diễn viên ưa nhìn\n+ Cốt truyện dễ tiếp cận\n+ Thông điệp gửi gắm nhẹ nhàng, ý nghĩa\n', '- Kịch bản quen thuộc\n- Phim không có nhiều điểm nhấn', ''),
(416, '', '', '- Cấu hình cao\n- Chip Intel khủng\n- Thời lượng pin tốt ', '- Thương hiệu Trung Quốc\n- Kích thước lớn\n- Phần mềm chưa đặc sắc', ''),
(418, '', '', '+ Bối cảnh hoành tráng\n+ Tạo hình nhân vật ấn tượng\n', '- Cốt truyện rời rạc, nhiều chỗ bất hợp lý\n- Diễn xuất kém\n', ''),
(419, '', '', '+ Trải nghiệm các phi vụ trộm cắp đầy kịch tính\n+ Nâng cấp đa dạng, kỹ năng phong phú\n+ Chế độ co-op tuyệt vời\n+ Giá trị chơi lại cao\n', '- AI hơi có vấn đề\n- Chơi đơn yếu kém\n', 'http://www.gameinformer.com/games/payday_2/b/pc/archive/2013/08/13/payday-2-review.aspx'),
(420, '', '', '+ Hành động đã mắt\n+ Vô cùng hài hước\n+ Các siêu anh hùng có tính cách đặc trưng hâp dẫn\n', '- Thiếu sự sảng khoái và sắc bén so với Kick Ass\n- Một số chi tiết thừa thãi\n', ''),
(421, '', '', '+ Mang nhiều yếu tố hài hước\n+ Diễn xuất dí dỏm\n', '- Ngôn ngữ thô tục\n- Nhiều hình ảnh quá lố bịch\n', ''),
(422, '', '', '+ Hệ thống chiến đấu và diễn hoạt nhân vật hài hước\n+ Cốt truyện điên rồ\n+ Rất nhiều điều thú vị để quậy phá\n+ Tinh chỉnh nhân vật đa dạng\n', '- Quá ít sự thử thách\n- Nhân vật chính quá bá đạo\n', ''),
(423, '', '', '+ Gameplay thông minh, đa dạng\n+ Hệ thống plant, zombie phong phú cả về chất và lượng\n+ Free-to-Play quá là tuyệt vời\n+ Hình âm vui nhộn\n', '- Tính năng Power up không thật sự cần thiết ', ''),
(424, '', '', '- Thiết kế thời trang, chất liệu Polycacbonat cao cấp\n- Màn hình hiển thị đẹp, dưới nắng dễ dàng thao tác\n- Tính năng 3G, sim kép thông minh\n- Hiệu năng đáp ứng tốt với mức giá của sản phẩm', '- Camera kém, không được đầu tư kỹ\n- Các phím cứng ( nguồn, volume ) khó thao tác\n- Bộ nhớ trong 2GB hơi ít', ''),
(425, '', '', '- Cảnh quay hoành tráng, thể loại hành động viễn tưởng.Các pha đấu súng hay cận chiến trong phim sinh động như thật\n- Điểm mới trong kịch bản: ý tưởng về sự phân chia giai cấp - giàu nghèo được khắc họa lên đến cực đỉnh. Thế giới người giàu, đẹp, xa hoa, được hưởng không khí trong lành, sạch, không bệnh tật. Cuộc sống chỉ đơn giản là hưởng thụ và không gì là không thể làm được, ko bênh tật gì là không thể chữa khỏi ở thế giới của người giàu. Trái ngược hoàn toán, là Trái đất - nơi chỉ dành cho người nghèo, với bệnh tật, không khí ô nhiễm, bẩn thỉu, nhếch nhác, và con người bị kiểm soát bởi robot. Với người giàu, họ có tất cả. Người nghèo thì ko gì cả, kể cả quyền cơ bản nhất là quyền con người. \n- Bên cạnh câu chuyện phiêu lưu của nhân vật nam chính, vẫn có những câu chuyện cảm động về tình cảm. Câu chuyện tình từ thuở ấu thơ giữa Max và Frey, câu chuyện của cô con gái Frey, lời dạy của nữ tu sĩ với cậu bé Max....', '- Bối cảnh năm 2514, nhưng cảnh hoang tàn của Trái Đất bị làm quá. Xem phim không có cảm giác của tương lai, mà cảm giác đó là bối cảnh của những năm 90 trở về trc\n- Các tuyến nhân vật có tính cách, nhưng chưa được khắc họa tới. Mạch phim chưa đạt đến cao trào cần thiết và cả cá tính nhân vật cũng chưa thật sự rõ rệt.\n- Các diễn viên chính như Matt Damon hay Jodie Foster chưa thực sự có nhiều đất diễn để thể hiện tài năng diễn xuất của mình ', ''),
(426, '', '', '- Thiết kế độc đáo, sang trọng.\n- Cấu hình mạnh mẽ với chip lõi tứ Snapdragon 800, 2GB RAM.\n- Màn hình cảm ứng sắc nét, độ sáng cao, viền màn hình mỏng.\n- Phụ kiện QuickWindows thông minh.', '- Thiết kế mới khiến người dùng phải mất thời gian làm quen.\n- Sử dụng chất liệu vỏ nhựa.\n- 3 phím cảm ứng nằm phía trong màn hình hiển thị.', 'http://www.tinhte.vn/threads/danh-gia-chi-tiet-nhat-lg-g2-man-hinh-rat-dep-vien-mong-nhieu-ung-dung-thong-minh.2157071/'),
(427, '', '', 'Một thế giới Google cực kỳ ấn tượng, đẹp mắt và đầy sáng tạo\nVui nhộn, hài hước\nThông điệp rõ ràng\nDiễn xuất tuyệt vời', 'Nội dung không có nhiều đặc sắc\nNhiều thuật ngữ công nghệ sẽ khiến người xem thông thường hơi khó hiểu', ''),
