(432, '', '', 'Chất lượng hình ảnh vượt trội so với TV LCD LED Kiểu dáng siêu mỏng 4 mm Thiết kế ấn tượng Tính năng Smart TV và 3D thụ động', 'Màn hình chưa có độ phân giải 4K và kích thước lớn hơn Giá bán cao và OLED còn chưa phổ biến', ''),
(433, '', '', 'Màn hình đẹp Hệ thống loa hay \nCấu hình mạnh mẽ Bàn phím có đèn nền \nTính năng sạc và nghe nhạc khi máy đã tắt hấp dẫn \nKiểu dáng chắc chắn bằng hợp kim và vỏ nhôm mạ crôm xước', 'Touchpad chưa nhạy \nSử dụng ổ cứng HDD thay vì ổ SSD hoặc ổ lai SSD-HDD \nThiết kế khe tản nhiệt không hợp lý', ''),
(434, '', '', 'Thời lượng sử dụng pin rất tốt \nMàn hình đẹp\nLoa ngoài hay \nGiao diện Sense 5 hấp dẫn, mượt \nCó khe cắm thẻ nhớ microSD', 'Vỏ nhựa, dễ trày xước \nKhông còn khả năng chống nước như phiên bản đầu tiên', 'http://sohoa.vnexpress.net/danh-gia/dien-thoai/danh-gia-htc-butterfly-s-smartphone-pin-khung-2870448.html'),
(435, '', '', 'Màn hình kích thước lớn 6.44 inch độ phân giải FullHD cho chất lượng hiển thị đẹp cùng khả năng sử dụng nhiều loại bút khác nhau. \nChống bụi và nước. \nPhần cứng vào loại mạnh nhất trên thị trường hiện nay.', 'Kích thước lớn khó sử dụng bằng một tay và bỏ vào túi áo quần. \nGiá cao.', 'http://sohoa.vnexpress.net/danh-gia/dien-thoai/danh-gia-phablet-xperia-z-ultra-chong-nuoc-cua-sony-2863166.html'),
