(440, '', '', 'Thiết kế đẹp, cá tính \nÂm thanh tốt với loa kép BoomSound và Beats Audio \nTính năng thú vị, tích hợp giao diện Sense 5 mới của HTC \nPin tốt \n2 sim', 'Giá hơi chưa thật sự tốt so với cấu hình \nDùng chip 4 nhân tầm thấp \nCamera 8 megapixel cho chất lượng trung bình', 'http://sohoa.vnexpress.net/danh-gia/dien-thoai/danh-gia-htc-desire-600-smartphone-dung-chip-loi-tu-gia-mem-2862211.html'),
