(447, '', '', 'Cảnh cuối Tap dance khá ảo', 'Diễn xuất quá tệ, quá gượng gạo\nVũ đạo quá kém, các bạn vũ công Việt Nam hơn xa các bạn diễn viên này\nCảnh quay tệ góp phần đưa bộ phim đi xuống hơn nữa\nPhim nhảy nhưng âm nhạc chán phèo\nGiống bộ phim PR cho Apple và Hàn Quốc\n', ''),
(453, '', '', '+ Thiết kế mỏng nhẹ\n+ Màn hình sáng, sắc nét\n+ Camera chụp ảnh đẹp và chụp thiếu sáng tốt\n+ Nhiều tính năng phần mềm thú vị', '- Không có khe cắm thẻ nhớ\n- Pin liền không tiện thay thế\n- Giao diện phần mềm hơi lòe loẹt', 'http://vnreview.vn/danh-gia-chi-tiet-di-dong/-/view_content/content/692853/danh-gia-dien-thoai-oppo-find-mirror'),
(454, '', '', '- Thiết kế đẹp, tinh tế\n- Màu trắng khó lộ vân tay\n- Máy mỏng nhưng nhiệt độ vẫn mát khi chạy ứng dụng nặng\n- Camera chụp thiếu sáng rất tốt', '- Màn hình và vỏ máy dễ xước\n- Loa bố trí thiếu hợp lý\n- 2 Phím cứng hơi nhẹ và dễ bấm phải ngoài ý muốn\n- Không tương thích với một số ít game', 'http://genk.vn/di-dong/danh-gia-chi-tiet-oppo-find-mirror-don-gian-nhung-khong-don-dieu-20130912195439981.chn'),
(450, '', '', '+ Thiết kế mỏng nhẹ\n+ Màn hình sáng, sắc nét\n+ Camera chụp ảnh đẹp và chụp thiếu sáng tốt\n+ Nhiều tính năng phần mềm thú vị', '- Không có khe cắm thẻ nhớ\n- Pin liền không tiện thay thế\n- Giao diện phần mềm hơi lòe loẹt', ''),
(451, '', '', 'Có sự pha trộn văn hóa Âu - Á, tạo nên sự đa dạng và mới mẻ trong các điệu nhảy', '- Âm nhạc ko xuất sắc\n- Vũ đạo không thực sự ấn tượng, ko tạo nên nét đặc sắc và ấn tượng như các phiên bản Step Up\n- Kịch bản đơn giản, ko có cao trào\n- Diễn xuất của diễn viên ko ấn tượng\n', ''),
(452, '', '', '- Kịch bản hay, khai thác đề tài về nội gián thời công nghệ cao - một đề tài thực sự HOT trong thời đại công nghệ như hiện nay \n- Bối cảnh đẹp\n- Diễn xuất của các diễn viên thực sự hoàn hảo ', '- Với một đề tài tốt như thế này, lẽ ra Âm ưu. kịch tính có thể được đẩy lên cao trào hơn, tinh vi hơn. Khi đó đây sẽ trở thành 1 bộ phim tâm lý hành động xuất sắc hơn rất nhiều \n\n', ''),
(455, '', '', '+ Pin dung lượng rất lớn\n+ Thiết kế đẹp hơn các thế hệ cũ\n+ Màn hình lớn, độ sáng khá cao', '+ Bộ nhớ trong 4GB nhỏ\n+ Hiệu năng chưa ổn định', 'http://vnreview.vn/danh-gia-chi-tiet-di-dong/-/view_content/content/679351/danh-gia-dien-thoai-pin-trau-lenovo-p780'),
(456, '', '', '+ Cải tiến đột phá với việc luân phiên chuyển đổi giữa 3 nhân vật chính\n+ Tinh chỉnh đa dạng với số lượng đồ sộ\n+ Rất nhiều hoạt động để làm và công việc khám phá bản đồ thực sự quá phấn khích\n+ Cốt truyện đổi mới hấp dẫn và kịch tính hơn rất nhiều\n+ Hệ thống nhiệm vụ đa dạng hấp dẫn, đặc biệt là trộm cướp\n+ Đồ họa xuất sắc mặc dù tuổi đời của hệ consle đã già cỗi\n', '', ''),
(457, '', '', '- Camera được cải tiến.\n- Cảm biến vân tay chất lượng tốt\n- Vi xử lý 64bit cao cấp A7 và vi xử lý cảm biến chuyển động M7\n- iOS 7 có nhiều cải tiến đáng giá', '- Thiết kế giống hệt với iPhone 5\n- Màn hình 4 inch quá bé so với các đối thủ\n- Cảm biến vân tay chưa hỗ trợ các ứng dụng của bên thứ 3', ''),
(458, '', '', '+ Dàn diễn viên đẹp với diễn xuất tốt\n+ Nhạc phim hay\n+ Kịch bản thông minh', '- Không mới trong cách xử lý tình huống\n- Cảnh quay trung bình', ''),
(459, '', '', '- Hình ảnh đẹp, màu sắc rực rỡ\n- Nội dung truyền tải có ý nghĩa', '', ''),
(230, '', '', '+ Lối chơi đậm chất hành động đỉnh cao.\n+ Đồ họa độc đáo và nghệ thuật.\n+ Thêm thắt yếu tố nhập vai giúp nâng tầm chất lượng.', '+ Cốt truyện quá quen thuộc, chưa đặc sắc như phiên bản đầu và Bound in Blood.\n+ Đấu boss không thử thách.\n', ''),
(462, '', '', '', '', ''),
(463, '', '', '+	Nhẹ hơn đáng kể\n+	Máy chạy rất mượt\n+	Pin lâu\n+	iOS 7 vẫn là hệ điều hành tốt nhất cho tablet\n', '-	Vẫn cần làm viền trên và dưới nhỏ hơn\n-	Không tích hợp những thứ tốt nhất Apple có thể làm\n-	Giá thành cao', 'http://www.tinhte.vn/threads/danh-gia-ipad-air-chiec-may-tinh-bang-10-tot-nhat.2204895/'),
(464, '', '', '+   Sản phẩm có thiết kế ấn tượng với màn hình to rất sắc nét cảm giác cầm rất chắc chắn.\n+   Máy có cấu hình rất mạnh với chip Snapdragon 800 và bộ nhớ RAM lên tới 3GB.\n+   Sky A890 có màn hình cảm ứng điện dung 5.9 inch Full HD Natural IPS Pro 1080p độ phân giải 1920 x 1080 pixel.\n+   Camera sau có dung lượng 13 MP không kém gì một chiếc máy ảnh kỹ thuật số với độ phân giải 1080p quay video HD.\n+   Máy có dung lượng pin cực kỳ khủng 3140 mAh cho thời gian đàm thoại và sử dụng rất tốt.', '-  Máy có màn hình lớn nên di chuyển đôi lúc hơi khó khăn\n-  Một số vấn đề tương thích với mạng hàn quốc như Tin nhắn chưa tương thích với Việt Nam khi chỉ có 80 Ký tự vấn đề này có thể khắc phục bằng phần mềm bên thứ 3 được\n-  Thương hiệu Sky chưa thực sự nổi tiếng ở VN và thế giới', 'http://sieuthismartphone.com/detail/product/dien-thoai-sky-a890/493'),
(465, '', '', '+ Màn hình lớn 5inch chất lượng cực nét nhờ công nghệ sản xuất màn hình cao cấp.\n+ Camera độ phân giải cao nhất trên thị trường smartphone Android với 20.7MP.\n+ Thiết kế nguyên khối, sang trọng, đẹp mắt.\n+ Bộ xử lý khủng Qualcomm Snapdragon 800 cho tốc độ lên đến 2.2GHz.\n+ Chống nước, chống bụi hiệu quả theo tiêu chuẩn IP55/IP58.', '+ Màn hình sử dụng ngoài trời vẫn có hiện tượng lóa.\n+ Nhiều tính năng cao cấp nên giá của thiết bị khá cao.', 'http://genk.vn/dien-thoai/danh-gia-chi-tiet-sony-xperia-z1-thiet-ke-dang-cap-hieu-nang-cao-20131027234337191.chn'),
(466, '', '', '+ Thiết kế dễ cầm nắm bằng một tay hoặc đặt đứng trên bàn\n+ Thời lượng pin siêu khủng\n+ Có hỗ trợ thẻ nhớ microSD', '- Phần cứng trung bình, có phần lỗi thời đặc biệt là độ phân giải màn hình\n- Giao diện cầu thả\n- Máy tương đối nặng', 'http://genk.vn/di-dong/danh-gia-lenovo-yoga-tablet-8-quai-vat-ve-pin-moi-noi-20131109231100257.chn'),
(467, '', '', '+ Thiết kế hiện đại, kiểu dáng sang trọng.\n+ Cấu hình khủng, tốc độ xử lý hoàn hảo với Snapdragon 800 cùng RAM 2Gb.\n+ Camera 8MP mang lại chất lượng hình ảnh tuyệt vời với tính năng ổn định hình quang học.\n+ Màn hình 5 inch Full HD cho trải nghiệm cực tốt.', '- Thiết kế chưa thật sự ấn tượng.\n- Camera cho chất lượng hình ảnh bình thường.', 'http://genk.vn/di-dong/nexus-5-dau-an-kho-phai-cua-google-20131109234835948.chn'),
(468, '', '', '+ Thiết kế sang trọng, đẹp mắt.\n+ Màn hình lớn 5 inch cho trải nghiệm tối ưu.\n+ Cấu hình tốt với vi xử lý lõi tứ 1.2GHz.\n+ Chụp ảnh HDR với camera 8.0MP sử dụng cảm biến Exmor R.', '+ Độ phân giải màn hình chỉ 960 x 540px.\n+ Vì dùng chíp của MediaTek nên hoạt động chưa được trơn tru', 'http://vnreview.vn/danh-gia-chi-tiet-di-dong/-/view_content/content/808289/danh-gia-dien-thoai-sony-xperia-c'),
(469, '', '', '+ Cấu hình mạnh\n+ Hệ điều hành iOS7 với nhiều cải tiến\n+ Nhiều sự lựa chọn về màu sắc', '- Thiết kế với lớp vỏ bằng nhựa làm mất đi vẻ sang trọng\n- Giá thành quá cao so với kỳ vọng của mọi người', 'http://www.techz.vn/danh-gia-nhanh-iphone-gia-re-dep-thoi-trang-nhung-gia-khong-he-re-ylt32031.html'),
(470, '', '', '+ Màn hình lớn 5.7 inch độ phân giải full HD siêu sắc nét.\n+ Cấu hình cực kỳ mạnh mẽ với vi xử lý Octa 8 nhân.\n+ Thiết kế sang trọng và đẹp mắt với viền giả kim loại và mặt sau được làm từ chất liệu giả da.\n+ Mọi tác vụ hằng ngày đều trở nên đơn giản với sự kết hợp giữa bút S Pen cùng các tính năng thông minh như Air Command, Action Memo, Scrapbook, S Finder, S Note, new Easy Clip,...', '- Thiết kế không thực sự ấn tượng, mặt da ở phía sau không phù hợp mấy với mặt trước của máy\n- Màn hình 5.7inch nên hơi bất tiện khi mang bên mình', 'http://www.techz.vn/'),
(471, '', '', '+ Thiết kế gọn gàng, thời trang, chất liệu cao cấp.\n+ Màn hình 6 inch, chất lượng full HD, góc nhìn rộng.\n+ Cấu hình thuộc Top \"khủng\" chip bốn nhân snapdragon 800 cho hiệu suất vượt trội.\n+ Pin 3400mAh có thời lượng tốt.\n+ Camera 20MP cho chất lượng hình ảnh tuyệt vời.', '- Màn hình quá khổ, sẽ khó sử dụng nếu chưa quen.', 'http://shortlink.vn/iecinjb2ho/v/danh-gia-nokia-lumia-1520-chiec-windows-phone-manh-nhat-hien-nay.html'),
(472, '', '', '+ Thân hình đẹp, nhỏ gọn, bền\n+ Màn hình đẹp, độ chính xác cao\n+ Hệ thống loa BoomSound làm việc tốt\n+ Camera chụp thiếu sáng tốt', '+ Các phím cứng hơi nông\n+ Camera thiếu sắc nét\n+ Hiệu năng còn kém\n+ Pin kém', 'http://vnreview.vn/danh-gia-chi-tiet-di-dong/-/view_content/content/791398/danh-gia-dien-thoai-htc-one-mini'),
(473, '', '', '+ Thiết kế đẹp, trẻ trung.\n+ Màn hình rộng 4.5 inch.\n+ Hệ điều hành Android 4.2 Jelly Bean có nhiều tính năng mới.\n+ Giá cả phải chăng.\n+ Tiện ích với 2 SIM 2 sóng.', '- Bộ nhớ RAM thấp, chỉ 512MB.\n- Bộ nhớ trong thấp, chỉ 4GB.', 'http://vnreview.vn/danh-gia-chi-tiet-di-dong/-/view_content/content/744589/danh-gia-dien-thoai-lenovo-a516'),
(474, '', '', '+ Thiết kế mỏng hơn phiên bản trước.\n+ Màn hình Full HD sắc nét, lướt web, xem phim thích hơn.\n+ Cấu hình chip lõi tứ 1.5GHz mạnh mẽ, xử lý mượt mà.\n+ Thời lượng pin ấn tượng 9 - 11 giờ.\n+ Hỗ trợ 2 camera, độ phân giải cao.', '- Không hỗ trợ khe cắm thẻ nhớ microSD.', 'http://www.thegioididong.com/may-tinh-bang/asus-google-nexus-7-2'),
(475, '', '', '+ Chống thấm nước.\n+ Chỉ mỏng 6.9 mm.\n+ Màn hình Full HD.\n+ Bộ vi xử lý 1.5GHz quad-core.\n+ Hỗ trợ NFC một chạm', '- Giá thành cao\n- ít tính năng hỗ trợ\n- Không có bút hỗ trợ', ''),
(476, '', '', '+ Thiết kế đẹp, sang trọng và cao cấp.\n+ Cấu hình cao với vi xử lý lõi tứ, RAM 2GB.\n+ Màn hình 8.3 inch full HD sắc nét.\n+ Hỗ trợ kết nối Wifi,3G online mọi lúc mọi nơi.\n+ Nhiều tính năng hiện đại như chạm 2 lần để mở/khóa màn hình,...', '- Vẫn còn một chút lag\n', ''),
(477, '', '', '+ Thiết kế cao cấp\n+ Màn hình đẹp\n+ Nhiều tính năng hữu dụng', '- Vẫn còn chút lag giật', 'http://genk.vn/di-dong/danh-gia-chi-tiet-lg-g-pad-83-danh-thuc-rong-ngu-quen-20131112231147159.chn'),
(478, '', '', '+ Độc đáo với màn hình cong và phím vật lý ở mặt sau.\n+ Cấu hình cao với CPU Snapdragon lõi tứ 2.26 GHz, RAM 2 GB.\n+ Camera độ phân giải 13 MP, chống rung quang học.\n+ Công nghệ tự động phục hồi vết xước ở mặt sau.\n+ Pin dung lượng 3500 mAh cho thời gian sử dụng lâu hơn.\n\n', '- Độ phân giải màn hình chỉ đạt 720p.\n- Khó đút túi quần', 'http://www.thegioididong.com/dtdd/lg-g-flex'),
(479, '', '', '+ Thiết kế đẹp, trẻ trung\n+ Hiệu năng khá tốt\n+ Giá hợp lý', '+ Máy vẫn hơi lag khi thao tac tác vụ nặng', 'cnet.vn'),
(480, '', '', '+ Khả năng chống nước và bụi.\n+ Cấu hình phần cứng mạnh mẽ.\n+ Màn hình 5 inch độ phân giải full HD.\n+ Trang bị nhiều tính năng hữu ích.', '- Máy hơi dày\n- Camera chỉ có 8 MP', 'http://www.techz.vn/danh-gia-galaxy-s4-active-hang-khung-chong-nuoc-ylt31515.html'),
(481, '', '', '+ Kiểu dáng bắt mắt\n\n+ Cấu hình tốt so với giá tiền\n\n+ Màn hình đẹp\n\n+ Hiệu năng khá', '- Camera khá tệ\n\n-  Cần up ROM để sửa nhiều lỗi\n\n- Chất lượng cuộc gọi chưa ổn', ''),
(482, '', '', '+ Thiết kế thời trang, cá tính.\n+ Vi xử lí lõi kép snapdragon S4.\n+ Trải nghiệm tuyệt vời với màn hình LCD IPS rộng 4,7 inch.\n+ Chụp ảnh chuyên nghiệp với Nokia Smart Camera.\n+ Làm việc hiệu quả ngay trên đường đi với MS Office và Outlook.', '+ Độ phân giải màn hình chỉ 480x800px.\n+ Bộ nhớ RAM chỉ 512MB', ''),
(483, '', '', '+ Màn hình 4.3 inch, hình ảnh trung thực, sắc nét.\n+ Camera độ phân giải cao, cho chất lượng tuyệt vời.\n+ Thiết kế mượt mà, thân máy mỏng, tính di động cao.\n+ Sử dụng chip bốn nhân, hiệu suất ổn định.\n+ Âm thanh trung thực với Beats Audio', '- Không hỗ trợ màn hình IPS góc nhìn rộng.\n- GPU Adreno 203, nên đồ họa chưa thực sự mạnh.', 'http://vnreview.vn/danh-gia-chi-tiet-di-dong/-/view_content/content/718131/danh-gia-dien-thoai-htc-desire-500'),
(484, '', '', '+ Thiết kế đẹp, chắc chắn với khung viền nhôm.\n+ Màn hình cảm ứng siêu nhạy, hình ảnh sắc nét với công nghệ Clearblack cùng Amoled.\n+ Sáng tạo hơn với Smart Cam giúp bạn chụp nhiều bức ảnh cùng lúc để tạo một chuỗi hành động liên tiếp.\n+ Bạn có thể điều chỉnh tiêu cự, tốc độ màn trập, ISO,... với Pro Cam.', '- Không hỗ trợ thẻ nhớ.\n- Cấu hình chưa cao.', 'http://vnreview.vn/danh-gia-chi-tiet-di-dong/-/view_content/content/713492/danh-gia-dien-thoai-nokia-lumia-925'),
(485, '', '', '+ Thiết kế thời trang, chất liệu cao cấp, sang trọng.\n+ Màn hình 6 inch, ấn tượng khi trải nghiệm video, phim, game.\n+ Camera hỗ trợ nhiều tính năng, chia sẻ dễ dàng.\n+ Tốc độ xử lý ổn định, mượt mà với Snapdragon S4.\n+ Pin dung lượng cao 3400mAh .\n', '- Không hỗ trợ sạc không dây.\n- Camera chỉ dừng lại ở 5MP.', 'cnet.com'),
(486, '', '', '+ Hiệu năng tốt\n+ Chống nước và bụi\n+ Cài đặt sẵn hệ điều hành Ice Cream Sandwich\n+ Màn hình 4.3 inch với độ phân giải HD rực rỡ', '- Giao diện của hãng trên nền Android 4.0 không hợp lý\n- Đế sạc bán kèm không sử dụng được với cổng USB\n- Camera khởi động chậm', 'cnet.com'),
(487, '', '', '+ Màn hình Retina đẹp, độ phân giải cao.\n+ Hiệu năng tốt.\n+ Bàn phím và Touchpad tuyệt vời.\n+ Nhiều công nghệ kết nối hiện đại.\n+ Thiết kế nổi bật.\n+ Thời lượng pin dài.', '- Máy hơi ồn khi dùng ở hiệu năng cao\n- Không có ổ đĩa quang\n- Giá còn cao', ''),
(488, '', '', '+ Thiết kế đẹp\n+ Hiệu năng xử lý tốt', '- Giá hơi cao\n- Dịch vụ hỗ trợ chưa được tốt', ''),
(489, '', '', '+ Thiết kế độc đáo\n+ Tốc độ chạy khá tốt', '- Tính tiện dụng cao\n- Giá cả hợp lý', ''),
(490, '', '', '+ Thiết kế tốt\n+ Giá tốt', '- Touchpad hoạt động không ổn định \n- Lựa chọn sử dụng ổ cứng cơ thay cho ổ thể rắn', ''),
(491, '', '', '+ Giá hợp lý\n+ Nghe gọi tốt ', '- Thiết kế bằng nhựa không cao cấp', ''),
(492, '', '', '+ Thiết kế đẹp, vỏ nhôm;\n+ Màn hình đẹp, góc nhìn rộng, chống chói tốt;\n+ Loa B&O cho âm thanh chi tiết;\n+ Bàn phím bàn rê tốt;\n+ Cấu hình cao;\n+ Vận hành mát mẻ cả ngày.', '- Thời lượng pin trung bình;\n- Không cổng VGA;\n- Nút điều hướng bố trí chưa hợp lý', ''),
(493, '', '', '+ Thiết kế khá đẹp, bàn phím bàn rê tốt;\n+ Màn hình đẹp, góc rộng, loa hay;\n+ Cấu hình cao;\n+ Giá cạnh tranh.\n', '- Bố trí cổng USB chưa hợp lý, khe tản nhiệt đặt bên phải;\n- Khá nóng tại khu vực nghỉ tay;\n- Không còn tùy chọn màn hình 3D.', ''),
(494, '', '', '+ Thiết kế chắc chắn;\n+ Màn hình to, chất lượng hiển thị khá;\n+ Thời lượng pin lâu;\n+ Giá rẻ, được cài sẵn Windows 8 64-bit', '- Loa nhỏ;\n- Layout phím chật chội;\n- 2 GB RAM hơi \"đuối\" đối với Windows 8 64-bit.', ''),
(495, '', '', '+ Thiết kế đẹp, chắc chắn;\n+ Trải nghiệm gõ phím tốt;\n+ Chất lượng loa khá;\n+ Vận hành mát mẻ.', '- Chất lượng màn hình kém;\n- Tùy chọn cấu hình không đa dạng nếu so với các dòng máy cùng phân khúc;\n- Thiếu các kết nối cao cấp chuyên dùng cho doanh nghiệp;\n- Thời lượng pin trung bình.', ''),
(496, '', '', '+ Màn hình khá tốt\n+ Thiết kế chắc chắn\n+ Có màn hình cảm ứng', '- Bàn phím chưa được tốt\n- Thời lượng pin trung bình\n- Chất lượng màn hình kém', ''),
(497, '', '', '+ Thiết kế tốt, rất vừa tay\n+ Cảm biến Avago 3090 cho độ nhạy và độ phản hồi tuyệt vời\n+ Nút bấm Omron với cảm giác bấm khá tốt\n+ Nhiều nút bấm cho khả năng tùy biến macro tốt\n+ Dây dẫn chắc chắn, bắt mắt, đầu cắm được mạ vàng\n+ Giá cả hợp lý\n', '- Không có hướng dẫn bằng tiếng Anh, driver khó tìm\n- Đóng gói sơ sài, không bắt mắt\n', ''),
(498, '', '', '+ Thiết kế đẹp\n+ Cục sạc di động tiện lợi\n+ Sử dụng được 2 máy điện thoại \n+ Chống ồn khá', '- Thiết kế khiến không thể dùng tốt khi mang kính\n- Thời gian thoại ngắn\n- Điều khiển khó khăn\n- Phần inear chỉ 1 size nên có thể không vừa với bạn,', ''),
(499, '', '', '+ Hành động đã mắt\n+ Kịch bản cải tiến sâu sắc so với phần một\n+ Nhân vật ấn tượng\n', '- Diễn biến quá nhanh khiến người xem khó nắm bắt hết nội dung', ''),
(500, '', '', '+ Thiết kế quá đẹp\n+ Thời lượng pin tốt', '- Giá cao\n- Hiệu năng chưa được tốt', ''),
(501, '', '', '+ Dung lượng cao\n+ Nhỏ gọn\n+ Hiệu năng tốt', '- Giá thành còn khá cao', ''),
(502, '', '', '+ Thiết kế trẻ trung, bắt mắt với mặt kính chống trầy.\n+ Vuốt nhẹ để truy cập nhanh mọi thứ.\n+ Pin khỏe, thời gian chờ lên đến 26 ngày.\n+ Hỗ trợ 2 sim, chuyển đổi sim linh hoạt.\n+ Lướt web nhanh, tiết kiệm chi phí với trình duyệt Nokia Xpress Browser.', '- Màn hình chưa nét.\n- Camera không có đèn flash.\n- Không có 3G.', 'http://www.tinhte.vn/threads/danh-gia-asha-501-nen-tang-dien-thoai-pho-thong-moi-cua-nokia.2139088/'),
(503, '', '', '+ Hỗ trợ học tập tốt\n+ Giá hợp lý', '- Máy còn lag và giật\n- Màn hình chưa được tốt', 'http://www.tinhte.vn/threads/danh-gia-nahi-kids-n70-thiet-bi-choi-ma-hoc-7-danh-cho-tre-em.2156534/'),
(504, '', '', '+ Bàn phím tuyệt vời\n+ Chất lượng hoàn thiện ổn\n+ Thiết kế mang nét cổ điển nhưng pha các điểm nhấn hiện đại\n+ BlackBerry 10 với hệ thống thao tác điều khiển tốt', '- Màn hình chưa xuất sắc, bị ngả vàng\n- Thao tác vuốt để quay trở về màn hình Multitasking bị vướng\n- Pin chưa ngon bằng những chiếc BlackBerry Bold 97xx', 'http://www.tinhte.vn/threads/danh-gia-blackberry-q10-su-tro-lai-cua-ban-phim-qwerty-vat-ly.2135450/'),
(505, '', '', 'Màn hình IPS 7 inch, hiển thị tốt ngoài trời\nChip lõi tứ mạnh mẽ tốc độ 1.2 GHz.\nThực hiện được cuộc gọi thoại và videocall.\nChạy hệ điều hành Android 4.2.\nKết nối USB OTG.', '- Camera thiếu đèn flash trợ sáng.\n- Máy vẫn còn lag, giật', 'http://www.tinhte.vn/threads/danh-gia-chi-tiet-lenovo-a3000-may-tinh-bang-7-2-sim-2-song.2158812/'),
(506, '', '', '+ Cấu hình cao\n+ Camera quay phim và xem chất lượng 4k\n', '- Không còn bút s-pen\n- Chưa thực dụng\n- Giá thành cao', ''),
(507, '', '', '+ Thiết kế chắc chắn, chân chống cải tiến cho góc nhìn và thao tác dễ dàng hơn;\n+ Hiệu năng cao hơn so với phiên bản cũ;\n+ Pin lâu hơn;\n+ Type Cover 2 cho trải nghiệm gõ phím tốt hơn.', '- Thiết kế dày nặng, không khác biệt với Surface Pro;\n- Màn hình, loa, camera vẫn tương tự phiên bản trước;\n- Giá cao.\n', ''),
(508, '', '', 'Thiết kế lạ nhưng sử dụng thoải mái, chất lượng thoại chấp nhận được, chất lượng nghe nhạc tốt đến rất tốt, hỗ trợ 2 điện thoại, pin xài lâu, tai nghe có rung khi nhận cuộc gọi', 'Tai nghe không thay thế được, nếu chẳng may làm đứt thì chắc phải mua cái mới hoặc dùng băng keo dán lại.', ''),
(509, '', '', '+ Thiết kê đẹp, dễ nhìn\n+ Bàn phím QWERTY dễ bấm\n+ Có Wi-Fi\n+ Có phím Facebook riêng, phím mở nhanh camera', '- Màn hình khó nhìn\n- Không có 3G (chỉ có 2G)\n- Không sạc qua cổng micro USB được', 'http://www.tinhte.vn/threads/danh-gia-nokia-asha-210-tinh-nang-tot-man-hinh-chua-ngon.2166746/'),
