(511, '', '', '+ Thiết kế đẹp, mỏng, nhẹ chất liệu cao cấp.\n+ Màn hình HD tấm nền IPS hiển thị tốt, góc nhìn rộng.\n+ Hiệu suất vượt trội nhờ vi xử lý Intel Atom tiên tiến cùng dung lượng RAM lớn đến 2Gb.\n+ Hỗ trợ bàn phím rời và bút stylus thuận tiện.\n+ Thời lượng pin ấn tượng lên đến 9 giờ.', '- Không có cổng USB 3.0.', 'http://vnreview.vn/tin-tuc-san-pham-moi/-/view_content/content/242190/danh-gia-nhanh-lenovo-thinkpad-tablet-2'),
(512, '', '', '+ Hiệu năng cao\n+ Màn hình có góc nhìn rộng\n+ Bán kèm bàn phím\n+ Có cổng HDMI và khe cắm thẻ nhớ microSD', '- Gắn máy tính bảng vào đế khó\n- Webcam có vị trí không phù hợp\n- Âm thanh nhỏ\n- Bàn phím quá nhỏ', 'http://vnreview.vn/danh-gia-chi-tiet-may-tinh-bang/-/view_content/content/251395/danh-gia-archos-101-xs'),
(513, '', '', '+ Màn hình ấn tượng nhất trong số tablet 7 inch\n+ Âm thanh mượt mà\n+ Giao diện tinh tế, dễ dàng truy cập vào các nội dung Amazon\n+ Hiệu năng/giá hấp dẫn', '- Đôi lúc tốc độ xử lý chậm chạp\n- Khó cầm hơn Google Nexus 7\n- Một số ứng dụng và game chưa có trên kho ứng dụng\n- Phải trả thêm 15 USD để mua bản không kèm quảng cáo', 'http://vnreview.vn/danh-gia-chi-tiet-may-tinh-bang/-/view_content/content/273179/danh-gia-kindle-fire-hd-7-inch-16-gb'),
(514, '', '', '+ Cấu hình mạnh mẽ đem lại hiệu năng cao\n+ Thiết kế cứng cáp, đẹp mắt\n+ Thời lượng pin rất xuất sắc\n+ Dock bàn phím kèm sạc pin dự phòng tiện lợi\n+ Hệ điều hành Android 4.1 Jelly Bean mới nhất\n+ Camera 8 megapixel quay film Full HD 1080p\n+ Đầy đủ các cổng kết nối thông dụng\n+ Chất lượng loa ngoài ấn tượng khi nghe nhạc và xem phim', '- Thiết kế hơi dày và nặng khi gắn với dock bàn phím\n- Chưa hỗ trợ kết nối 3G', ''),
