(561, '', '', '+ Chất âm tổng thể hay\n+ Bass uy lực nhưng không gây mệt tai\n+ Dải âm cao trong sáng\n+ Các tầng âm đồng đều', '- Thiết kế chưa thật thoải mái\n- Gây nóng và đau tai khi dùng lâu\n- Cáp tín hiệu thô, thiếu thẩm mỹ\n- Khớp xoay giữa vòm chụp và củ tai còn cứng', ''),
(562, '', '', '+ Bass mạnh mẽ\n+ Thiết kế cứng cáp\n+ Không gian âm thanh khá rộng', '- Cáp tín hiệu khá mảnh mai\n- Âm thanh thiếu độ chi tiết', ''),
(563, '', '', '+ Thiết kế kim loại cứng cáp\n+ Âm thanh mạnh mẽ\n+ Độ động ấn tượng\n+ Bass chắc chắn, gọn gàng.', '- Dải trung-cao thiếu ấm áp\n- Thiết kế còn thiếu thoải mái khi sử dụng trong thời gian dài\n- Âm trường chưa đủ rộng', ''),
(564, '', '', '+ Nốt trầm khá\n+ Giá thành thấp\n+ Trọng lượng nhẹ\n+ Micro tích hợp lọc ồn khá hiệu quả', '- Các khớp xoay chưa thật trơn\n- Khả năng loại bỏ tạp âm môi trường thấp\n- Chất âm khi nghe nhạc chỉ trên mức trung bình', ''),
(565, '', '', '+ Chất âm khá, không gian âm thanh tốt.\n+ Tiếng bass đầy ấm dễ nghe\n+ Thiết kế gọn nhẹ, chắc chắn', '- Chất âm khá, không gian âm thanh tốt.\n- Tiếng bass đầy ấm dễ nghe\n- Thiết kế gọn nhẹ, chắc chắn', ''),
(566, '', '', '+ Chất âm khá\n+ Hỗ trợ speaker phone\n+ Ngoại hình đẹp, nhỏ gọn', '- Thời lượng pin thấp\n- Rung cổ loa khi mở hết mức âm lượng', ''),
(567, '', '', '+ Ngoại hình đẹp, cứng cáp\n+ Có thể sử dụng pin rời\n+ Hỗ trợ sạc pin cho iPod\n+ Hỗ trợ ngõ vào tín hiệu âm thanh 3,5mm', '- Chất âm chỉ trên mức trung bình\n- Đèn LED nằm ở vị trí khó quan sát\n- Sơn bóng phủ bề mặt loa còn bám dính dấu vân tay\n- Bộ điều khiển từ xa có phạm vi hoạt động hẹp', ''),
(568, '', '', '+ Thiết kế đẹp, tính di động cao\n+ Bass đầy, ấm không bị vỡ tiếng', '- Dải âm trung chưa thật mượt\n- Giảm độ chi tiết âm thanh khi nghe từ khoảng cách xa', ''),
(569, '', '', '+ Nghe nhạc không dây.\n+ Gọn, nhẹ, sử dụng linh hoạt.\n+ Báo thức tiện, nghe đài FM tốt, nghe nhạc khá.', '- Có thể rè nếu nghe nhạc to gặp bass lớn', ''),
(570, '', '', '+ Vỏ ngoài bằng kim loại khá chắc chắn, hạn chế trầy xước và in dấu vân tay.\n+ Tông xám bạc hợp với nhiều mẫu máy tính hiện nay đặc biệt là máy Mac của Apple.\n+ Dung lượng lớn lên đến 64 GB.\n+ Giao tiếp USB 3.0 tốc độ cao nhưng vẫn tương thích ngược với các hệ thống USB 2.0.', '- Kích thước hơi lớn và khá nặng do vỏ bằng kim loại.\n- Giá còn khá cao.', ''),
(571, '', '', '+ Thiết kế đẹp.\n+ Sử dụng chuẩn SATA 3.0 với tốc độ truy xuất dữ liệu cao.\n+ Giá bán hấp dẫn.', '- Phụ kiện đi kèm còn ít', ''),
(572, '', '', '+ Công nghệ Advanced DHX (Dual-path Heat eXchange) giúp RAM tản nhiệt hiệu quả.\n+ Corsair Link giúp dễ dàng theo dõi nhiệt độ RAM khi kết nối với Corsair Link Cooling and Lighting.\n+ Hiệu năng cao.\n+ Khả năng ép xung linh hoạt.', '- Giá cao hơn so với các kit RAM cùng xung nhịp.', ''),
(573, '', '', '+ Hiệu năng khá\n+ Hỗ trợ tốt', '- Giá thành còn cao', ''),
(574, '', '', '+ Thiết kế sang trọng.\n+ Có khả năng làm chủ không gian lớn\n+ Kết nối mạnh nhờ DLNA, AirPlay và PlayDirect.', '- Ít tính năng phụ trợ\n- Âm trầm có thể tốt hơn nữa\n- Giá cao hơn sản phẩm cạnh tranh', ''),
(575, '', '', '+ Máy có cấu hình cao.\n+ Màn hình hiển thị khá.\n+ Thiết kế vừa tay.\n+ Giá thành rẻ.', '- Máy có cấu hình cao.\n- Màn hình hiển thị khá.\n- Thiết kế vừa tay.\n- Giá thành rẻ.', 'http://www.techz.vn/danh-gia-nhanh-hkphone-racer-dien-thoai-binh-dan-gia-re-MHN-VBM-ylt34619.html'),
(576, '', '', '+ Giá rẻ\n+ Trang bị android phiên bản mới', '- Chất lượng gia công chưa được tốt', 'http://vnreview.vn/danh-gia-chi-tiet-di-dong/-/view_content/content/818793/danh-gia-nhanh-dien-thoai-gionee-pioneer-p3'),
(577, '', '', '+ Màn hình full HD\n\n+ Giá hấp dẫn', '- Chất lượng hoàn thiện chưa được cao\n- Chạy ứng dụng có hiện tượng lag, giật', 'http://www.tinhte.vn/threads/tren-tay-q-smart-dream-si.2217641/'),
(578, '', '', '+ Giá thành ổn', '- Chất lượng ảnh chưa được cao', 'http://vnreview.vn/danh-gia-chi-tiet-may-anh-so/-/view_content/content/823868/danh-gia-nhanh-may-anh-canon-powershot-sx170-is'),
(579, '', '', '+ Giá dễ chịu\n+ Nhỏ gọn dễ mang lại', '- Cảm biến nhỏ\n- Chất lượng ảnh bình thường', 'http://vnreview.vn/danh-gia-chi-tiet-may-anh-so/-/view_content/content/810679/danh-gia-nhanh-may-anh-olympus-stylus-1'),
(580, '', '', '+ Chất lượng ảnh tuyệt vời\n+ Kiểu dáng xu hướng hoài hổ, bí ẩn', '- Giá thành siêu cao', ''),
(581, '', '', '+ Ảnh chụp JPEG sắc nét và nhiều chi tiết hơn RX1\n\n+ Tính năng xử lý JPEG có thể loại bỏ vân sọc và nhiễu răng cưa khá tốt\n\n+ Giá và giao diện người dùng được giữ nguyên so với RX1\n\n+ Cảm biến full-frame 24MP chất lượng cao\n\n+ Ống kính Carl Zeiss Sonnar 35mm f/2 T*\n\n-+Lấy nét tự động rất nhanh\n\n+ Chất lượng ngang ngửa và thậm chí là vượt trội so với các máy DLSR full-frame.', 'Dễ bị vân sọc, nhiễu răng cưa và màu không chính xác hơn RX1\n\n- Chụp RAW không được cải thiện nhiều so với RX1\n\n- Ống kính gắn liền có tiêu cự cố định fix-length, hạn chế khả năng sử dụng của máy\n\n- Ống kính không đi kèm mà được bán rời\n\n- Quá đắt so với các máy dạng compact khác (2.800 USD tại Mỹ, tức khoảng 60 triệu đồng)', ''),
(582, '', '', '+ Chất lượng ảnh chụp tốt\n+ Kết cấu máy tốt, thiết kế đẹp\n+ Dễ sử dụng\n+ Tính năng chụp \"ưu tiên ống kính\" thú vị', '- Thân máy và ống kính hơi lớn\n- Không có bộ sạc pin rời', 'http://vnreview.vn/danh-gia-chi-tiet-may-anh-so/-/view_content/content/567533/danh-gia-may-anh-samsung-nx300'),
(583, '', '', '+ Kích thước nhỏ gọn, thiết kế độc đáo\n+ Màn hình cảm ứng nhạy, nghiêng lật được\n+ Kết nối chia sẻ qua Wi-Fi nhanh chóng chỉ bằng một nút bấm', '- Các chức năng trên màn hình cảm ứng hiển thị nhỏ, dễ bấm nhầm\n- Cảm giác cầm máy chưa chắc chắn', 'http://vnreview.vn/danh-gia-chi-tiet-may-anh-so/-/view_content/content/567619/danh-gia-may-anh-canon-powershot-n'),
(584, '', '', '', '', 'http://vnreview.vn/danh-gia-chi-tiet-may-anh-so/-/view_content/content/502304/tren-tay-panasonic-lumix-dmc-gf6'),
(585, '', '', '+ Zoom 20x\n+ Thiết kế nhỏ gọn, đẹp', '- Chất lượng ảnh ở mức chấp nhận được', 'http://vnreview.vn/danh-gia-chi-tiet-may-anh-so/-/view_content/content/469345/danh-gia-so-bo-sony-cyber-shot-dsc-wx300'),
(586, '', '', '+ Giá mềm (449 USD/9,5 triệu đồng – giá gốc tại Mỹ).\n\n+ Bàn phím chắc chắn.', '- Thời lượng pin quá tệ.\n\n- Hiệu năng thấp.\n\n- Góc nhìn hẹp.\n\n- Nút nguồn đặt ở vị trí bất tiện.', ''),
(587, '', '', '', '', ''),
(588, '', '', '+ Thiết kế sắc nét, chắc chắn, gọn nhẹ và tiện lợi.\n+ Màn hình cảm ứng đa điểm, LED Truelife\n+ Hiệu suất khá.\n+ Touchpad lớn\n+ Chất lượng loa tốt và âm lượng to.\n+ Thời lượng pin tốt\n+ Thời gian bảo hành lâu', '- Hệ thống tản nhiệt thiết kế chưa tốt, tỏa nhiệt ở bàn phím..\n- Màn hình gương dễ bị lóa, góc mở chỉ đạt 135 độ\n- Ổ lưu trữ HDD, không dùng SSD\n- Chỉ dùng chip đồ họa tích hợp của Intell, hiệu năng không cao.\n- Pin không thể tháo rời.', ''),
(589, '', '', '+ Thiết kế chắc chắn\n+ Hiệu năng tốt\n+ Pin thời lượng lâu', '- Giá thành còn cao', ''),
(590, '', '', '+ Xe đẹp, ngầu\n+ Nhiều đồ chơi, không cần nâng cấp thêm\n+ Cảm giác ngồi thoải mái\n+ Xe nhẹ, dễ di chuyển trong thành phố và hẻm nhỏ\n+ Dễ ngồi, cao 1 mét 6 là điều khiển OK.\n+ Tiết kiệm xăng.\n+ Không cần bằng lái A2.', '- Không thích hợp để đi xa: yên hơi cứng, khó chở thêm đồ.\n- Tay côn cứng, dễ mỏi tay.\n- Nhiệt độ xe quá nóng khi đi chậm.\n- Các chi tiết nhựa chỗ đồng hồ và thùng xăng có chất lượng hoàn thiện chưa cao, cảm giác không cao cấp và cứng cáp cho lắm.', ''),
(591, '', '', '+ Thiết kế tốt trong các dòng xe hạng B hiện tại\n+ Không gian nội thất rộng rãi, khoang chứa hành lý lớn\n+ Chế độ S cho trải nghiệm lái thú vị, lẫy chuyển số trên tay', '- Trần xe ở phần đầu hơi thấp\n- Khả năng chống ồn của gầm chưa tốt\n- Ốp cửa nhựa có cảm giác ọp ẹp', ''),
(592, '', '', '+ Kiểu dáng bóng bẩ\n+ Giá thành tốt', '+ Không còn cảm giác sang trọng giống phiên bản trước\n+ Máy không thực sự tốt\n', ''),
(593, '', '', '+ Thiết kế trẻ trung\n+ Ăn ít xăng\n+ Giá thành tốt', '- Máy hơi yếu', ''),
(594, '', '', '+ Nhỏ gọn\n+ Chất lượng video tốt\n+ Có HDR\n+ Menu và phím cứng dễ sử dụng\n+ Giá khá tốt, khoảng 3 triệu đồng (giá chưa chính thức, mình sẽ cập nhật sớm)\n+ Có HDMI out, tha hồ mà chiếu phim', '- Không có GPS log\n- Đèn led chỉ để trang trí, nói chung là quên cái đèn đó đi :)\n- Màn hình hiển thị chất lượng không ngon lắm, chỉ đủ để xem biết sự kiện, muốn xem hay thì phải đem vô máy tính, nhưng bù lại có HDMI ở phần ưu', ''),
(595, '', '', '+ Nhỏ nhưng zoom tới 10x bắt đầu bằng 24mm (tương đương) rất hữu dụng\n+ Chất lượng hình rất tốt ở phần khúc máy nhỏ gọn\n+ Tải ảnh không dây qua wifi tới điện thoại và thiết bị di động rất tiện lợi\n\n', '- Hệ thống phím bấm hơi nhỏ và cứng, cách bố trí tính năng trong menu\n- Khẩu độ hơi khiêm tốn.', ''),
(596, '', '', '+ Thiết kế chắc chắn\n+ Độ bền cao', '- Hiệu năng bình thường\n+ Dáng hơi thô', ''),
(597, '', '', '+ Giá thành tốt\n+ Hiệu năng cao', '- Giá thành còn cao', ''),
(598, '', '', '+ Vận hành tốt\n+ Giá cả phải chăng', '- Thiết kế chưa được đẹp', ''),
(599, '', '', '+ Thiết kế trẻ trung, màu sắc\n+ ít hao xăng\n+ Có nút đòng mở tiện lợi', '- Giá thành còn hơi đắt', ''),
(600, '', '', '+ Bảo mật tốt\n', '- Cần cải thiện về hiệu năng', ''),
(601, '', '', '+ Kiểu dáng đẹp\n+ Âm thanh nghe khá trong', '- Giá thành còn đắt', ''),
(602, '', '', '+ Xe nhẹ, dễ điều khiển\n+ Máy đầm, pô êm\n+ Động cơ mạnh, tăng tốc nhanh, xe bốc\n+ Rất ít hao xăng', '- Bắt đầu giảm tính ổn định từ mức 80km/h trở lên\n- Cần đạp số về phía trước hơi sâu', ''),
(603, '', '', '+ Kiểu dáng đẹp\n+ Vận hành tốt', '- Giá thành hơi cao', ''),
(604, '', '', 'Xe chính hãng, giá tốt.\nXe cực kỳ ổn định và êm ái, kể cả khi chạy suốt nhiều giờ liền.\nThùng xăng lớn.\nFI tiết kiệm xăng (hơn 50 cây/lít đường trường).\nXe vẫn ổn định khi chạy trên 100km/h.\nGầm xe cao.\nYên xe to.\nĐi đường trường tốt.', '- Dùng mâm hiếm 18\".\n- Lốp sau nhỏ, bám đường kém, trơn trợt.\n- Đuôi xe chưa đẹp.\n- Tem xe màu đen quá xấu.', ''),
(605, '', '', '+ Kiểu dáng đẹp\n+ Vận hành trơn tru', '- Giá hành còn đắt', ''),
(606, '', '', '+ Xe bốc, mạnh\n+ 200 phân khối, là xe phân khối lớn\n+ Xác xe nhẹ, trọng lượng khô 129kg nên dễ dắt và nhích đuôi\n+ Điều khiển dễ, cảm giác lái rất tốt, đằm và an toàn\n+ Dễ ngồi, phù hợp với chiều cao \"khiêm tốn\" 1 mét 6\n+ Thắng ABS làm việc rất tốt', '- Tay côn nặng, mau mỏi tay\n- Nhiệt độ rất nóng ở két nước làm mát, hơi nóng phả ra 2 bên đùi\n- Nhiều chi tiết hoàn thiện không sắc sảo như đèn xi-nhan, tay lái, kính hậu, mặt đồng hồ...', ''),
(607, '', '', '+ Thiết kế mỏng đẹp, sang trọng, ấn tượng;\n+ Âm thanh hay, màn hình khá tốt;\n+ Tốc độ xử lý nhanh, bàn rê nhạy;\n+ Vận hành êm ái, không ồn, mát mẻ;\n+ Pin lâu.', '- Bàn phím chưa tốt, không có đèn nền;\n- Góc quan sát màn hình hơi hẹp;\n- Nắp máy thiết kế hơi khó mở;\n- Giá chưa hợp lý.', '');
INSERT INTO `rate_jreviews_review_fields` (`reviewid`, `jr_location`, `jr_agegroup`, `jr_pros`, `jr_cons`, `jr_readfullreview`) VALUES
(608, '', '', '+ Hình dáng lạ mắt, ngầu.\n+ Thiết kế gọn trong lòng bàn tay.\n+ Phím bắn tỉa to, dễ bấm, hoạt động tốt.\n+ Khu sườn và đế bằng kim loại khá chắc chắn.\n+ Cho phép điều chỉnh trọng lượng chuột bằng 3 viên tạ nhỏ.\n', '- 3 viên tạ nhỏ trọng lượng không đáng kể.\n- Phím chuột trái/phải hơi ngắn.', ''),
(609, '', '', '', '', ''),
(610, '', '', '+ Thiết kế mỏng, nhẹ, sang trọng, lịch lãm;\n+ Nhiều cổng kết nối tiêu chuẩn;\n+ Pin khá tốt, vận hành mát mẻ, không ồn;\n+ Màn hình chống chói, sáng và hiển thị rõ ràng;\n+ Bàn phím và bàn rê dễ sử dụng;\n+ Tích hợp nhiều công nghệ về độ bền\n+ Cấu hình khá tốt.', '- Thiết kế màn hình hơi lỏng lẻo, dễ cong khi mở ra đóng vào;\n- Thời gian sạc lâu;\n- Tốc độ truy xuất ổ cứng SSD vẫn hơi chậm.', ''),
(611, '', '', '', '', ''),
(612, '', '', '', '', ''),
(613, '', '', '', '', ''),
(614, '', '', '', '', 'http://fptshop.com.vn/nokia-x'),
(615, '', '', 'trung tâm phố cổ , gần hồ hoàn kiếm, giá cả phải chăng , nhân viên thân thiện', 'không có thang máy', 'www.khachsantrungtamhanoi.com'),
(619, '', '', 'Sản phẩm phù hợp với người ăn chay', '', ''),
(620, '', '', 'Không gian tuyệt vời, toàn trai xinh gái đẹp từ hội viên tới nhân viên\nCó thể coi là phòng tập 5* sang hịn ở khu Trung Hoà Nhân Chính này luôn. R&B thì quá nổi rồi, toàn trai xinh gái đẹp hot girl hot boy lui tới. Mà cụ thể là anh idol của mình cũng tới tập chỗ này luôn. Nằm trên tầng 3 toà 29T1, view xuống đường & các toà chung cư khác thôi, ko có gì quá lạ.\n\nCác lớp tập được update hàng tuần trên facebook, trong khi website lại gần như bỏ không vì chả có thông tin gì. Huấn luyện viên các lớp nhiệt tình & tập rất mạnh mẽ dứt khoát, thái độ cũng chuyên nghiệp. Từ máy móc, phòng tắm, xông hơi đến nhân viên đều ok. Sảnh lễ tân có 1 băng ghế sofa dài màu đỏ rực luôn mới chịu, ấn tượng ngay tức thì.\n\n\n\n', 'Giá tập hơi cao', 'http://phuot9.com/list-cac-phong-gym-co-review-tot-tren-toan-quoc.html'),
(618, '', '', 'Có dạng viên dể sử dụng, dễ mang theo có thể uống ở bất kỳ đâu.         \nViên tảo biển có nhiều tác dụng với sức khỏe như bồi bổ cơ thể, phòng bệnh, …\nHầu hết mọi người đều có thể sử dụng tảo biển spirulina nhật bản 2200 viên\nLà thực phẩm sạch từ thiên nhiên, cơ thể dễ hấp thụ, không có tác dụng phụ.\nMức giá khá tốt với một sản phẩm có nhiều tác dụng.', 'Có vị tanh khó uống\nNhiều hàng giả, hàng nhái', 'http://suckhoesacdep.vn/tin-tuc/review-tao-xoan-Nhat-Ban-tao-xoan-spirulina-nhat-ban-2200-vien.html'),
(621, '', '', 'Không gian đẹp, phòng tập chất lượng,\nMột trong những phòng tập có view đẹp và thoáng nhất Hà Nội. Phòng tập rộng, thoáng và thích nhất là có tầm nhìn rộng. Ít phòng tập có được view đẹp như phòng tập này.\n\nMình thích nhất dàn máy chạy được bố trí dọc bên cạnh mảng tường kính. Vừa chạy vừa ngắm cảnh khá thoải mái, chứ không bị úp mặt vào bờ tường hay phải cắm mặt vào máy chạy (mình không thích xem tv hay lướt net khi tập lắm, bên cạnh đó, việc cúi xuống nhìn màn hình máy chạy cũng khiến cho tư thế chạy không được chuẩn).\nDàn Half rack cũng được bố trí ở nơi nhìn ra khoảng không giữa các tòa nhà. Rất đẹp (như hình)\n\nMáy tập thì chủ yếu của Techno. Đẹp, xịn. Nhưng nếu bạn nhỏ con hơn mình thì có thể sẽ có trở ngại nhất định vì kích thước máy khá to.', 'Giá hơi cao', 'http://phuot9.com/list-cac-phong-gym-co-review-tot-tren-toan-quoc.html'),
(622, '', '', ' Test Test', 'Test', ''),
(623, '', '', ' Test Test', 'Test', ''),
(624, '', '', 'Cơ sở vật chất hiện đại\nLớp tập ở đây đa dạng về số môn & khung giờ tập.\nMức giá tính trung bình nếu mua trọn gói cả năm sẽ khoảng 800k/tháng.', '', ''),
(625, '', '', 'Phòng tập strength quá tốt so với mức giá, được setup có chủ đích cho powerlifting nên anh em yên tâm.\ngiá cả và phòng tập ổn nhất trong khu vực Hà Đông\nPhòng tập đẹp, sạch, tạ color block màu mè chích choè thích hợp check in.', '', ''),
(626, '', '', 'Giá tập hợp lý, 300k/tháng\nKhông gian rộng, thoáng\nMáy móc đa dạng, phục vụ đủ nhu cầu tập các nhóm cơ khác nhau', '', ''),
(627, '', '', 'Cơ sở vật chất khang trang, tiện nghi, mang lại cho bạn cảm giác thoải mái trong thời gian luyện tập.\nPhòng tập được thiết kế rộng rãi, bài trí hiện đại và có nhiều trang thiết bị tập luyên thể dục cao cấp, đáp ứng mọi nhu cầu tập luyện của học viên.\nThời gian tập linh hoạt phù hợp với các hội viên chuyên nghiệp lẫn không chuyên, mở cửa tất cả các ngày trong tuần.\nTập luyện thường xuyên sẽ giúp bạn có một vóc dáng thon gọn, một cơ thể dẻo dai để học tập và làm việc.\nHọc viên được sử dụng miễn phí tất cả các dịch vụ hỗ trợ như tủ cá nhân, internet', '', ''),
(628, '', '', 'Với diện tích hơn 1000m2 , phòng tập có không gian rộng rãi thoáng, được chia thành các khi riêng biệt dành cho nam và nữ như: sauna (xông khô), steambath (xông ướt).\n- Phòng tập được trang bị hơn 100 loại máy tập hiện đại nhằm đáp ứng nhu cầu luyện tập của học viên.\n- Với đội ngũ HLV chuyên nghiệp và nhiệt tình hướng dẫn học viên sử dụng máy, bài tập cơ bản trong buổi tập đầu tiên, những buổi tập sau HLV sẽ hướng dẫn bất cứ khi nào khách có nhu cầu.\n- Học viên được sử dụng tủ đựng đồ và các trang thiết bị ở phòng tập miễn phí.', '', 'http://phongtap.thehinh.com/phong-tap-gym/phong-tap-the-hinh-nha-van-hoa-thanh-nien-youth-gym-quan-1'),
(629, '', '', 'S’Life Gym Fitness & Yoga Center mang giải pháp tập luyện và kiến thức dinh dưỡng khoa học tốt nhất trên thế giới đến với học viên, mang lại cơ thể khỏe mạnh, thân hình đẹp đúng chuẩn và tìm hiểu thông tin cần thiết về chế độ dinh dưỡng phù hợp.\nS’Life tự hào là trung tâm tiên phong mang chương trình tập luyện khoa học, được mua bản quyền từ Mỹ, mang đến giải pháp tập luyện và dinh dưỡng tối ưu nhất, được thiết kế cho từng cá nhân, cho cả người lớn và trẻ em, đã được kiểm chứng bởi các ngôi sao hạng A của Hollywood.\nĐội ngũ nhân sự trẻ, thân thiện, năng động, yêu nghề có trình độ chuyên môn cao, phong cách làm việc chuyên nghiệp luôn sẵn sàng tư vấn, hỗ trợ mọi vấn đề về sức khỏe cho khách hàng. Huấn luyện viên cá nhân có bằng cấp chuyên môn tập luyện, dinh dưỡng khoa học, đội ngũ chủ chốt là những kiện tướng thể thao cấp quốc gia.\nHọc viên được kiểm tra các chỉ số cơ thể. Đo chỉ số cơ thể bằng máy Inbody 270 xác định lượng cơ, mỡ, cân nặng, chỉ số BMR…, từ đó xác định nguyên nhân, tình trạng của từng học viên và đưa ra giải pháp phù hợp.\n100% trang thiết bị tập luyện được nhập khẩu hoàn toàn từ Mỹ, đảm bảo an toàn trong quá trình tập luyện của hội viên.\nS’ Life YOGA có nhiều khóa học từ cơ bản tới chuyên sâu, trong không gian tập rộng rãi với nhiều cây xanh. Giảng viên là những người có bằng cấp, chứng chỉ trong yoga. Có nhiều năm kinh nghiệm giảng dạy cho hàng ngàn học viên trong và ngoài nước. Ngoài ra, bạn sẽ được phục vụ khăn riêng, detox…hoàn toàn miễn phí.\nKhông gian tại phòng tập của S’Life được thiết kế mở, nhiều cây xanh, rộng rãi, thoáng mát, thân thiện với môi trường.', '', 'http://phongtap.thehinh.com/phong-tap-gym/phong-tap-slife-gym-fitness-yoga-center-cach-mang-thang-8-tan-binh'),
(630, '', '', 'Phòng tập Gym Dr.Fitness là trung tâm Fitness & Yoga kết hợp y tế theo tiêu chuẩn 05 sao.\nHuấn luyện viên cá nhân chuyên nghiệp được đào tạo theo giáo trình Fitness & y tế. Lớp học Yoga được huấn luyện viên Jitendra Gill đến từ Ấn độ có nhiều năm kinh nghiệm, hướng dẫn bài bản, tận tình.\nKhông gian thiết kế sang trọng, trang thiết bị máy móc hiện đại, cao cấp.\nTiện nghi với khu vực internet, khu vực giữ trẻ, phòng xông hơi, quầy bar phục vụ các món ăn và thức uống thơm ngon, dinh dưỡng.', '', 'http://phongtap.thehinh.com/phong-tap-gym/phong-tap-gym-dr-fitness-go-vap-tphcm'),
(631, '', '', 'Là phòng tập dành riêng cho nữ\nCó huấn luyện viên nhiệt tình chỉ bảo.\nPhòng tập rộng rãi, sạch sẽ.\nChế độ hậu mãi chu đáo\nThời gian tập luyện linh hoạt', '', 'http://phongtap.thehinh.com/phong-tap-gym/phong-tap-gym-newlife-quan-7-phong-tap-danh-rieng-cho-nu'),
(632, '', '', 'Đội ngũ giáo viên My Gym Vietnam là những chuyên gia có kinh nghiệm và kỹ năng trong lĩnh vực giáo dục thể chất dành cho trẻ em, đến từ nhiều trung tâm My Gym trên thế giới. Bên cạnh đó, những giáo viên người Việt là những người trẻ trung, năng động và được đào tạo bài bản tại My Gym USA, My Gym Hong Kong.\nKhóa học được xây dựng và phát triển dựa trên các nghiên cứu về vật lí học, tâm lí học và xã hội học, cùng với hàng chục năm kinh nghiệm của hàng trăm chuyên gia của My Gym trên toàn thế giới.\nPhòng học trang trí màu sắc, hiện đại, an toàn cho trẻ\nTrẻ được gắn kết với những bạn nhỏ xung quanh thông qua các trò chơi tập thể, đặt nền móng đầu tiên cho kĩ năng giao tiếp xã hội và hòa nhập cộng đồng.', '', 'http://phongtap.thehinh.com/phong-tap-gym/phong-tap-my-gym-childrens-fitness-center'),
(633, '', '', 'Sản phẩm mang lại hiệu quả điều trị tích cực\nGiá tương đối phù hợp\n', 'KHi dùng, một số người sẽ có cảm giác nóng trong người', ''),
(634, '', '', 'Có 2 vị cam và dứa dễ uống', '', ''),
(635, '', '', 'Fitness & Yoga Kzen sở hữu phòng tập được thiết kế hiện đại, cách bố trí máy móc hợp lý, ánh sáng và âm nhạc hài hòa đem đến cho bạn sự hứng khởi khi tập luyện.\nTại đây, học viên được sử dụng tủ đựng đồ, chỗ giữ xe, xông hơi, tắm nóng lạnh, wifi...\nĐầy đủ các loại máy móc, trang thiết bị, hỗ trợ tối đa cho quá trình rèn luyện sức khỏe của học viên.\nĐội ngũ các huấn luyện viên chuyên nghiệp, tận tình.', '', 'http://phongtap.thehinh.com/phong-tap-gym/cau-lac-bo-kzen-fitness-yoga-nam-tu-liem-ha-noi'),
(636, '', '', 'Phòng tập gym Zone Fitness là địa chỉ uy tín trong việc đáp ứng nhu cầu rèn luyện sức khỏe của nhiều người.\nPhòng tập sở hữu không gian khá rộng rãi, thoáng mát. Phòng tập tiện nghi, cách bày trí năng động, hiện đại, nhằm tạo cảm giác hứng thú cho người luyện tập.\nPhòng tập gym Zone Fitness đầu tư vào các trang thiết bị tân tiến, các loại máy tập chuyên dụng hàng đầu.\nĐến với Zone Fitness, bạn sẽ được luyện tập theo một quy trình khoa học để phát triển tối đa thể chất và vóc dáng.\nNgoài Gym, Zone Fitness còn có các chương trình tập tăng thể lực, giảm cân, luyện hình thể đẹp và phục hồi bệnh lý...\nĐược để xe, wifi, tắm nóng lạnh miễn phí', '', 'http://phongtap.thehinh.com/phong-tap-gym/phong-tap-gym-zone-fitness-hai-ba-trung-ha-noi'),
(637, '', '', 'Môi trường tập luyện chuyên nghiệp, lành mạnh.\nĐầu tư các trang thiết bị hiện đại, đa dạng.\nHLV chuyên nghiệp, tận tâm.\nPhòng tập rộng rãi, thoáng mát, sạch sẽ.\nChất lượng dịch vụ đảm bảo tốt nhất.\nChi phí luôn là rẻ nhất.', '', 'http://toplist.vn/top-list/phong-tap-gym-uy-tin-va-chat-luong-nhat-nha-trang-16972.htm'),
(638, '', '', 'Phòng tập đẳng cấp, sang trọng, lịch sự.\nHệ thống thiết bị máy móc đa dạng, hiện đại.\nNhân viên phòng niềm nở, thân thiện với học viên.\nĐội ngũ HLV siêu nhiệt tình và chuyên nghiệp, đảm bảo làm hài lòng cả những vị khách khó tính nhất.\nChi phí hợp lý.\nBài tập đa dạng, phong phú đáp ứng mọi nhu cầu của học viên.', '', 'http://toplist.vn/top-list/phong-tap-gym-uy-tin-va-chat-luong-nhat-nha-trang-16972.htm'),
(639, '', '', 'Đội ngũ HLV chuyên nghiệp, nhiệt tình.\nHệ thống trang thiết bị máy móc hiện đại.\nKhông gian phòng tập rộng rãi, thoáng mát.\nĐa dạng các bài tập đáp ứng mọi nhu cầu của học viên.\nCó dịch vụ xông hơi miễn phí.\nChi phí hợp lý.', '', ''),
(640, '', '', 'Hệ thống máy móc hiện đại, tối tân.\nHLV chuyên nghiệp, tận tình hướng dẫn cho học viên.\nPhòng tập rộng rãi, thoáng mát, sạch sẽ.\nGiá cả hợp lý.\nBài tập đa dạng, phong phú.\nChất lượng dịch vụ đảm bảo tốt nhất.', '', ''),
(641, '', '', 'Thường xuyên mở các chương trình khuyến mãi với những ưu đãi cực hấp dẫn.\nMôi trường tập luyện chuyên nghiệp, lành mạnh.\nĐầu tư các trang thiết bị hiện đại, đa dạng\nĐội ngũ HLV chuyên nghiệp, năng động có nhiều năm kinh nghiệm và đạt nhiều giải thưởng quốc gia, quốc tế.', '', 'http://toplist.vn/top-list/phong-tap-gym-uy-tin-va-chat-luong-nhat-hai-phong-16944.htm'),
(642, '', '', 'Hệ thống máy móc hiện đại, tân tiến.\nHLV chuyên nghiệp, tận tâm.\nPhòng tập rộng rãi, thoáng mát, sạch sẽ.\nGiá cả phải chăng.\nBài tập đa dạng, phong phú.\nChất lượng dịch vụ đảm bảo tốt nhất.', '', 'http://toplist.vn/top-list/phong-tap-gym-uy-tin-va-chat-luong-nhat-hai-phong-16944.htm'),
(643, '', '', 'Thường xuyên mở các chương trình khuyến mãi với những ưu đãi cực hấp dẫn.\nMôi trường tập luyện chuyên nghiệp, lành mạnh.\nĐầu tư các trang thiết bị hiện đại, đa dạng\nĐội ngũ HLV chuyên nghiệp, năng động có nhiều năm kinh nghiệm và đạt nhiều giải thưởng quốc gia, quốc tế.', '', 'http://toplist.vn/top-list/phong-tap-gym-uy-tin-va-chat-luong-nhat-hai-phong-16944.htm'),
(644, '', '', '', '- Chất lượng thấp, không như quảng cáo\n- Dịch vụ hậu mãi, bảo hành cực kỳ tệ', ''),
(645, '', '', 'Giá cả hợp lý\nKhông có tác dụng phụ\nCó thể sử dụng cho phụ nữ', '', ''),
(646, '', '', 'Giá thành hợp lý\nPharmekal là công ty có tiếng tại Mỹ trong lĩnh vực sản xuất các sản phẩm chăm sóc sức khỏe', 'Sản phẩm chỉ giúp bổ sung vitamin chứ không thể thay thế việc xây dựng chế độ ăn hợp lý, đầy đủ các chất dinh dưỡng', ''),
(647, '', '', 'Không chứa gluten\nKhông chứa lactose\nKhông màu hoặc mùi nhân tạo', '', ''),
(648, '', '', 'Sản phẩm phù hợp cho cả phụ nữ, trẻ em, người già.\nKhông gây cảm giác no và đầy bụng', 'Nước cốt có vị tanh, ngai ngái và khó uống.', ''),
